(5, 1, 3, 'PORTABEBES', '<h2 style=\"text-align:justify;\">Portabebes - disfruta del porteo con nuestro asesoramiento.</h2>\n<p style=\"text-align:justify;\">Descubre el portabebés perfecto para ti y tu pequeño. Explora nuestra selección de mochilas ergonómicas, fulares, bandoleras y mei tais ideales para el confort y la seguridad de tu bebé.</p>', 'portabebes', 'Portabebes ergonómicos - los mas bonitos y cómodos', 'mei tai, mochila, portabebe, mochila portabebe, fular, bandolera', 'Portabebes ergonómicos: disfruta del porteo, lleva y siente a tu bebé bien cerquita. 10 años asesorando sobre el mejor portabebes. '),
