(27, 1, 3, ' Patucos', '<h2>Patucos para bebés cosidos artesanalmente a mano.</h2>', 'patucos', 'Patucos para bebés cosidos a mano.', 'Patucos, zapatitos, bebé, originales, artesania', 'Patucos modernos para bebes recien nacidos. Elige tu estampado favorito y confeccionamos los patucos de tu bebé a medida. Un regalo original para bebés.'),
(27, 1, 4, 'Chaussons', '<p>Adorables chaussons pour les plus petites! Fait a main avec ton tissu de coton favorite or cuir. Les chaussons sont très confortable et permettent bébé de garder la sensation pieds nus.</p>', 'chaussons-bebe', 'Adorables chaussons pour les plus petites, fait a main avec coton', 'Chaussons', 'Adorables chaussons pour les plus petites, fait a main avec coton or cuir, Ils sont très confortable et permettent  bébé de garder la sensation pieds nus'),
(25, 1, 4, 'Vaisselle pour bébé', '<p>Ils mangent seuls ? Voici quelques articles Toute la sorte de produits originaux et utiles pour aider votre bébé commence à manger, la chaise haute, bobs…Simpa et plein de couleur!</p>', 'vaisselle-pour-bebe', 'Des accessoires pour faciliter les repas de bébé et la vie des parents', '', 'Pour faciliter les repas de bébé et la vie des parents, nous vous proposons produits qui permettant de nourrir votre enfant dans les meilleures conditions'),
(26, 1, 1, ' High chairs', '', 'high-chairs', 'Pocket high chair,perfect to use everywhere, compact,Safe and comfy', 'high chairs, feeding, diaper, custom baby', 'Pocket high chair, perfect to use everywhere whether they\'re observing the world around them, playing, or enjoying mealtime with the family! Safe and comfy'),
(26, 1, 3, ' Tronas', '<h2>Tronas de tela: para sentar al bebe en cualquier silla.</h2>\n<h3>Trona portatil, un regalo útil para sorprender.</h3>', 'tronas', 'Tronas de tela: para sentar al bebe en cualquier silla.', 'trona tela, trona plegable, trona portatil, trona bebe, trona, asiento bebé', 'Trona de tela: para llevar en el bolsillo y poder sentar a tu bebé en cualquier silla.'),
(6, 1, 1, ' Mei tai baby carrier', '<p>Mei tai baby carrier, super comfortable, ready to go or design for you! Mei Tai comes from the ancient way chinese women carried their babies, Nowdays, Mei tais come in a wide range of diferent colors and patterns, they are perfect for active families, providing a new comfortable, and stylish solution for carrying babies and toddlers</p>', 'mei-tai', 'Mei tai baby carrier, comfortable, ready to go or design for you!', 'baby sling, baby carrier, baby', ''),
(6, 1, 3, ' Mei tai', '<h2 style=\"text-align:left;\"><strong>Mei tai</strong> - para portear con comodidad!</h2>', 'mei-tai', 'Mei tai - portabebe ergonomico para portear a tu bebé', '', 'Mei tai personalizado. Con un mei tai puedes portear a tu bebé hasta los 3 años. Elige tu estampado y color favorito y customiza tu mei tai. Envio gratis.'),
