(25, 1, 3, ' Baby-vajilla', '<p>Vajilla funcional y moderna para los bebes. Originales articulos para bebes y padres modernos.</p>', 'baby-vajilla', 'Baby vajilla: la primer vajilla de tu bebe', 'vaso antigoteo, vaso pico, vaso bebe, beber bebe, alimentacion bebe', 'Baby Vajilla: vasos antigoteo, fundas de platano... modernos y funcionales articulos para cuando tu bebe empieza a comer.'),
(5, 1, 4, ' PORTE-BÉBÉ', '<p>Pour porter ton bébé : mei tai, foulards, écharpes...</p>', '-porte-bebe', 'Pour porter ton bébé : mei tai, foulards, écharpes', 'mei tai, mochila, portabebe, mochila portabebe', 'Pour porter ton bébé : mei tai, foulards, écharpes'),
(6, 1, 4, 'Mei tai', '<p>Notre mei tais sont fait à la main. Leurs matières vous offrent une douceur et une solidité vous permettant de porter bébé confortablement et en toute sécurité.</p>', 'mei-tai', 'Portebébé Mei tai,Notre meitais sont fait à la main avec tisu coton', 'mei tai,portebébé', 'Portebébé Mei tai,Notre meitais sont fait à la main.Leurs matières vous offrent une douceur et une solidité vous permettant de porter bébé en toute quiétude'),
(48, 1, 1, ' GIFTS JUST FOR KIDS', '<p>Just for kids, great present ideas, the perfect newborn gift, if you are looking for something that we´ll make a difference …you´ve find it!</p>', 'just-for-kids', 'Just for kids, great present ideas, the perfect newborn gift', '', 'Just for kids, great present ideas, the perfect newborn gift, '),
(48, 1, 3, 'REGALOS ORIGINALES PARA BEBE', '<h2>Regalos originales y prácticos para sorprender!</h2>', 'regalos-originales-para-bebe', 'Regalos originales para bebes y recien nacidos', '', 'Regalos para bebes utiles, practicos, originales y sobre todos únicos como tu bebé. Muchos de los productos de nuestra tienda solo podras encontrarlos aqui.'),
(10, 1, 1, ' PREGNACY AND BREASTFEEDING', '<p>Pregnancy &amp; breastfeedind products, that will help you trough maternity. In this section You will find breastfeeding, pumps, medela, breastfeeding covers, delivery accesories, home birth midwives</p>', 'breastfeeding', 'Pregnancy & breastfeedind products,that will help you trough maternity', 'breastfeeding, pumps, medela', 'Pregnancy & breastfeedind products, that will help you trough maternity. breastfeeding, pumps, medela, covers..'),
(10, 1, 3, 'ROPA LACTANCIA - LIQUIDACION', '<h2>Liquidación de últimas unidades en vestidos de lactancia materna.</h2>', 'ropa-lactancia-liquidacion', 'Vestidos lactancia materna liquidación - Teoyleo', '', 'Encuentra vestidos de maternidad modernos y juveniles que facilitan la lactancia, disponibles a precios especiales en nuestra liquidación.'),
(293, 1, 3, 'EASYWALKER ACCESORIOS', '<h2>Colchonetas y sacos para la silla Easywalker - hacemos que tu carrito luzca único.</h2>', 'easywalker-accesorios', 'EASYWALKER accesorios para el carrito - Teoyleo', '', 'Descubre nuestros sacos y colchonetas confeccionadas a medida para la silla de paseo Easywalker. Con tu estampado favorito.'),
(179, 1, 3, 'Bodies y pijamas bebés ', '<p>Bodys, bodysuits y pijamas originales para bebes molones.</p>', 'bodies-originales-bebes', 'Ropa bebe original. Bodys modernos para bebes molones.', '', 'Bodys originales para bebes molones. Pijamas para que tu bebe luzca un look moderno y lleno de color. Un regalo perfecto para cualquier recien nacido.'),
(123, 1, 1, 'FUNKY BABY CLOTHES', '<p>Funky, funny baby outfits. Colorfull and original, dresses, onesies, overall and complement. And always comfy for the little ones. Looking for an original present?? Wellcome to teoyleo!</p>', '-ropa-bebe-original', 'original baby clothes', 'original baby clotthes, colorfull baby outfits, baby overall', 'funky and funny baby outfits.'),
