(10, 1, 4, 'GROSSESSE ET ALLAITEMENT', '<p>Allaiter est fondamental pour la santé de nos enfants. Le lait maternel est un aliment complet et l’allaitement maternel favorise la relation mère- enfant indispensable pour le développement harmonieux du Bébé Les sages-femmes, les infirmières, les pédiatres et le personnel de santé en général recommandent l’allaitement maternel exclusif jusqu’aux 6 mois du Bébé, puis préconisent l’association lait maternel et alimentation diversifiée au moins jusqu’aux 2ans de l’enfant. L’alimentation de l’enfant grâce au lait maternel, constitue le fait décisif de son développement, et a une grande influence sur la santé du Bébé. Aucun lait en poudre, aucune préparation, aucun lait d’origine animale n’est aussi digeste que le lait maternel, lui seul couvre les besoins nutritionnels du Bébé. Avec lui l’enfant est protégé contre les diarrhées graves ou autres maladies, et même s’il tombe malade, il guérira beaucoup plus rapidement que les enfants nourris avec du lait en poudre. A partir d’ici, nous parlerons d’intégrer tous les produits qui aident à établir, faciliter et prolonger avec succès l’allaitement.</p>', 'grossesse-et-allaitement-', 'Allaiter les produits qui aident à établir avec succès l’allaitement', 'Allaiter', 'Allaiter est fondamental pour la santé de nos enfants. les produits qui aident à établir, faciliter et prolonger avec succès l’allaitement.'),
(11, 1, 1, ' Breast Pumps', NULL, 'breast-pumps', NULL, 'medela, breast pumps, breastfeeding', NULL),
(11, 1, 3, ' Sacaleches', '¿Que es un sacaleches? Un sacaleches es un aparato que sirve para ayudar a la madre a extraer la leche del pecho. También se llaman extractores de leche materna. Pueden ser manuales o eléctricos.', 'sacaleches', 'Sacaleches o extractores de leche materna de Medela', 'lactancia, sacaleches, extractor leche materna, leche materna, amamantar, dar el pecho, mastitis, medela, comprar sacaleches', 'Descubre los sacaleches mas respetuosos con la lactancia: sacaleches de Medela. Gastos de envio gratis y regalo exclusivo.'),
(11, 1, 4, 'Sacaleches', NULL, 'sacaleches', NULL, NULL, NULL),
