(18, 1, 1, ' ROCK BABY ', '<p>If you have a rock baby come here and discover our original articles</p>', 'rock-baby', 'Perfect baby products for Rock and roll parents! ', 'rock baby, cool baby', 'Perfect baby products for Rock and roll parents! Becaouse becaming a family doesn´t have to be boring!'),
(18, 1, 3, ' BEBE ROCKERO', '<p>Según mi experiencia los bebés reciben mucha ropa de regalo que jamas les verás puesta. Eso no suele ocurrir con la ropa de bebé rockera.</p>', 'bebe-rockero', 'Bebé rockero - ropa de bebé rockera que mola un huevo', 'bebe rock, bebe original, bebe calavera, calaveritas, bodys calaveras', 'Si tu bebé esta poseido por el espíritu de Iron Maiden y no te deja dormir por las noches, quizas sea buena idea vestirlo como un rockero.'),
