(79, 1, 3, 'BOLSOS Y OTROS ACCESORIOS', '<h2>Bolsos para carritos de bebes y otros accesorios.</h2>', 'bolsos-bebe', 'Bolsos para carritos de bebes exclusivos', 'bolsos bebe, bolsos carrito bebe, bolsos maternales, bolso carrito bebe, bolsos para carritos de bebe, bolsos carro bebe, bolsos de bebe, bolsos para carritos, bolso maternal, bolsos cochecito bebe, bolsos para bebes modernos, bolso bugaboo', 'Bolsos para carritos de bebes. Bolsos Bugaboo, Jane, Maclaren, Uppa Baby... Los bolsos y accesorios mas divertidos y originales para llevarlo todo en orden.'),
(79, 1, 4, 'SAC Á LANGER POUR BÉBÉ', '<p> Les sacs à langer et des accessoires assortis  pour des mamans les plus exigeantes.! <br />Sac á langer avec un design actuel pour se vivre comme un sac à main la journée. <br />Vous l\'aurez compris, transporter le nécessaire de bébé pour une journée n\'est plus une contrainte !  <br /> Le sac à langer est indispensable lors des sorties avec votre bébé. Le sac á langer permet d\'emporter toutes les affaires importantes par votre bébé et par vous! le goûter, les rechanges, les lingettes, le doudou, les couches et toutes ses petites affaires.</p>\n<p>Nous avons sélectionné pour vous de sacs a langer modern, et sympa, pour tous les goûts. Nos sacs à langer revendiquent tous les styles. <br />Le sac week-end pour bébé prend des allures de sac trolley pour les longues escapades. Le sac à bandoulière par les plus citadines qui ne veulent rien céder de leur look casual.  <br /><br /></p>', 'sac-a-langer-pour-bebe', 'SAC Á LANGER POUR BÉBÉ', 'SAC Á LANGER POUR BÉBÉ, POUSSETTE', 'Ici vous pouvez trouver,   Les sacs à langer, des accessoires assortis, destapis à langer pour bébé des protège-carnet de santé aux mêmes motifs.'),
