(122, 1, 1, 'cushion-teddy bear', 'Each Bibu character can be used as a teddy bear, as a pillow or as a decorative cushion.\r\nPrinted directly onto the fabric using water base non-toxic ink.\r\nSewn together with a custom designed pattern on the back.\r\nAll Bibu pattern are originals, with a range of geometric shapes and a variety of bold color choices and well combined to stimulate the imagination.', 'cojines-peluche', 'Realy cute pillows-teddys', 'teddy, pillow, babytoy', 'Are they pillows or teddys?? Both ofe them, perfect to hug and great for a pillow fight!'),
(122, 1, 3, 'Cojines-peluche', 'Un regalo dos en uno! Cada pequeña obra de arte puede ser utilizada como un osito de peluche, como una almohada o como un cojín decorativo.\r\nImpresos directamente sobre la tela con tintas no tóxicas hechas a base de agua.\r\nConfeccionados junto a un estampado en la parte posterior, diseñado especialmente para convertir cada cojín en una pieza única.\r\nTodos los estampados Bibu son diseños originales, son un conjunto\r\nde formas geométricas y una gama de colores llamativos que bien combinados pretenden estimular el sentido de la vista y la imaginación.', 'cojines-peluche', 'Preciosos cojines-peluche', 'cojin, peluche, juguete', 'Son peluches o cojines? Las dos cosas perfectos para abrazar y hacer guerras de almohadas!'),
