(156, 1, 3, 'Saco Kimono bebé', '<p>Saco bebe con forma de kimono. Abriga a tu bebé con estilo!</p>', 'saco-kimono-bebe', 'Saco dormir bebé - con forma de kimono', 'saco dormir bebe, kimono', '¿Buscas un saco de dormir para bebé? En Teoyleo encontrarás nuestros sacos kimonos para bebes personalizados. Un regalo ideal para hacer a un recien nacido.'),
(156, 1, 4, 'TURBULETTE NAISSANCE JAPONISANTE', '<p>Gigoteuse japonisante, aussi appelée turbulette, duvette ou douillette Les Gigoteuses de Teoyleo sont douces aux couleurs plus vives, turbulettes charmants fait a main, il y a mille et une façons de faire passer des nuits de rêve à votre bébé!</p>', 'turbulette-naissance-japonisante', 'Gigoteuse japonisante,aussi appelée turbulette,duvette ou douillett', 'Gigoteuse japonisante,  turbulette, duvette ou douillette', 'Gigoteuse japonisante, aussi appelée turbulette,duvette ou douillett ,trés mignon, turbuletets douce, fait a main avex tissu de cotton et velour'),
(157, 1, 1, 'Diaper bags by Kiwisac', '<p>A lovely selection of diaper bags, stroller bags by spanish brand kiwisac.</p>\n<p>Colorfull and chic.</p>', 'diaper-bags-by-kiwisac', 'A lovely selection of diaper bags, stroller bags by kiwisac.', NULL, 'A lovely selection of diaper bags, stroller bags by spanish brand kiwisac.\r\n\r\nColorfull and chic.'),
(157, 1, 3, 'Bolsos bebé Kiwisac', '<p>Los bolsos Kiwisac son modernos y alternativos, para padres originales y practicos.</p>', 'bolsos-bebe-kiwisac', 'Kiwisac, prácticos bolsos para llevar todas las cosas de tu bebé.', 'Kiwisac, bolsos Kiwisac, bolso bebé, bolso carro Kiwisac, bolso silla, Kiwisac online, Kiwisac piratas, Kiwisac lisitapo, Kiwisac anai, Kiwisac family, bolso maternidad Kiwisac', 'Los bolsos Kiwisac estan diseñados en España y pensados para padres practicos y modernos. Los colores de estos bolsos de bebé son alegres y diferentes!'),
(157, 1, 4, ' Sacs á langer par Kiwisac', '<p>A jolie Selection de Sacs á langer pour poussette By Kiwisac<br />Quand vous partez en promenade avec bébé, il faut tout prévoir, Les nombreux rangements de les sac á langer vous permettront d\'organiser et de ranger tout le nécessaire de bébé </p>', 'sacs-a-langer-par-kiwisac', 'A jolie Selection de Sacs á langer pour poussette By Kiwisac', 'sac a langer, sac a poussette', 'A jolie Selection de Sacs á langer pour poussette By Kiwisac\r\nles sac á langer vous permettront d\'organiser et de ranger tout le nécessaire de bébé '),
(158, 1, 1, 'Cambiador bebé Kiwisac', NULL, 'cambiador-bebe-kiwisac', NULL, NULL, NULL),
(158, 1, 3, 'Cambiador bebé Kiwisac', 'Cambiadores originales y divertidos de la marca española Kiwisac.', 'cambiador-bebe-kiwisac', 'Kiwisac, cambiador bebé para cambiar el pañal en cualquier lugar.', 'cambiador, kiwisac, cambiador bebé', 'Por su tamaño y diseño los cambiadores Kiwisac son ideales para usarlos en el cambio diario del pañal del bebé. Cambiadores modernos y practicos como tu!'),
(158, 1, 4, 'Cambiador bebé Kiwisac', NULL, 'cambiador-bebe-kiwisac', NULL, NULL, NULL),
(159, 1, 1, 'Pacifier holder', '<p>Pacifier holder, you can Attach it to baby\'s pacifiers and teethers to keep them off the floor, Can be attached to belt loops, diaper bags and strollers. They are esigned to keep your child\'s pacifier clean and handy when needed.</p>', 'pacifier-holder', 'Pacifier holder', '', 'Pacifier holder, you can Attach it to baby\'s pacifiers and teethers to keep them off the floor, Can be attached to belt loops, diaper bags and strollers'),
(159, 1, 3, 'Portachupetes bebé', '<h2><span>Portachupetes Personalizados y Elegantes para tu Bebé</span></h2>', 'portachupetes-bebe', 'Portachupetes bebé personalizados', 'portachupetes, chupete, Kiwisac', 'Explora en Teoyleo nuestra selección de portachupetes personalizados y elegantes, perfectos para mantener el chupete de tu bebé seguro y a mano. Diseños únicos y prácticos para el día a día.'),
(159, 1, 4, 'Attache sucette ', '<p>L\'Attache sucette est une accessoire indispensable de bébé. L\'Attache Sucette permet aux parents de ne plus perdre la sucette de bébé.la tétine reste la fidèle compagne de bébé.Elle se fixe tout simplement sur les vêtements, bébé garde le sourire et la sucette reste propre !</p>', 'attache-sucette', 'Attache sucette Accessoire indispensable de bébé,Cadeau de naissance', '', 'Attache sucette Accessoire indispensable de bébé, Cadeau de naissance, L\'Attache Sucette permet aux parents de ne plus perdre la sucette de bébé.'),
