(167, 1, 1, 'Bugaboo Cameleon Seat liner', '<p>Bugaboo Camelon stroller seat covers – treat your baby with an exclusive Design.</p>\n<p>Custom bugaboo camelon covers, renew your baby stroller with your personal touch.</p>\n<p>Make your bugaboo camelon unique with our huge super soft cotton fabric catologue.</p>\n<p>Choose your favorite print, geometric, flowers, stars, dinos…and we´ll make it for you,</p>\n<p>We have bugaboo covers that are just 1 piece, the cover the back and 2 pieces covers, back and seat.</p>\n<p>They are really easy to wear.</p>\n<p>Dress up your Bugaboo Cameleon Stroller and make it the one and only.</p>', 'bugaboo-cameleon-seat-liner', 'Dress up your Bugaboo Stroller with our custom fitted seat cover.', 'seat cover bugaboo, seat liner bugaboo, seat camaleon, seat bugaboo, seat cover bugaboo camaleon, custom bugaboo, customized your bugaboo camaleon', 'Make your Bugaboo a real eye-catcher with one of our funky seat liners! Protect the seat and change the traditional design. Choose your favourite pattern.'),
(167, 1, 3, 'Fundas Bugaboo Camaleon', '<h2 style=\"text-align:left;\"><strong>Fundas Bugaboo Camaleon</strong> - mima a tu bebe con un diseño exclusivo.</h2>', 'fundas-bugaboo-camaleon', 'Fundas Bugaboo Camaleon - fundas diferentes y sin lazos!', '', 'Fundas para el asiento de la silla Bugaboo Camaleon para mimar a tu bebé. Especialistas en diseñar fundas que se reconocen por la calle por su estilo único.'),
(167, 1, 4, 'Housse pour Bugaboo Camaleon', '<p>Housses pour Bugaboo Camelon poussette .</p>\n<p>Personnalisez votre Housse pour Bugaboo Camelon.  Si vous n\'aimez pas l\'uniformité et que vous voulez donner une touche différente à votre poussette Bugaboo Camelon, nos housses la rendront unique et spéciale. Housses personnalisées pour Bugaboo Cameleon avec douce tisu a coton, elles s\'y ajustent parfaitement, choisissez le tissu qui vous plaît le plus et mettez en valeur votre poussette de manière originale.  </p>\n<p>Housse avec 2 piéces, cette housse est dessiné pour customiser votre poussette, et donner à votre bugaboo camelon a unique look.<br /> Fait a main avec votre  tisu de coton favorite.<br /> Il s\'adaptent parfaitement à votre poussette et protège la peau délicate de bébé du contact avec les fibres synthétiques du siège</p>', 'housse-pour-bugaboo-camaleon', 'housse pour poussette bugaboo camelon, fait a main  avec coton tissu', 'pousette bugaboo cameleon, housse camelon, accesoires bébé', 'Housse por poussette bugaboo camelon, fait a main a L\'Spagne avec tissu coton,cette housse de poussete permet un ajustement parfait  à votre bugaboo cameleon'),
(168, 1, 1, 'Bugaboo Cameleon carry cot Accesories', '<p>Choose your favourite patter option to go with your bugaboo base and give your pushchair a new look by changing the design. Choose the tailored fabric set that suits you and put your own touch to it.</p>', 'bugaboo-cameleon-carry-cot-accesories', 'Bugaboo carrycot, apron with funky and rock designs - Teoyleo', 'apron bugaboo, carrycot bugaboo, carrycot donkey, personalized carrycot Bugaboo', 'Bugaboo carrycot, refresh the look of your pushchair with new designs by choosing your favourite pattern, we have more than 100! Shipping all over world.'),
(168, 1, 3, 'Capazo Bugaboo Camaleon', '<h2 style=\"text-align:left;\"><strong>Fundas capazo Bugaboo Camaleon</strong>, viste diferente tu Bugaboo Camaleon!</h2>', 'capazo-bugaboo-camaleon', 'Fundas capazo Bugaboo Camaleon - únicas como tu bebé', '', 'Fundas capazo Bugaboo Camaleon con originales estampados. Viste tu cochecito Camaleon con tejidos 100% algodón. ¡Renueva y diferencia tu capazo!'),
