(169, 1, 1, 'Bugaboo Cameleon accessories', '<p>Personalized your Bugaboo and change the look of your pushchair by choosing your favourite pattern fabric.</p>', 'bugaboo-cameleon-accessories', 'Personalized your Bugaboo pushchair', 'custom bugaboo covers, personalized bugaboo strollers, handmade bugaboo covers, custom cameleon bugaboo, custom frog bugaboo, custom frog bugaboo covers, custom cameleon bugaboo covers, stylish bugaboo covers, Bugaboo Stroller Cover, Bugaboo accessories', 'Personalized your Bugaboo and change the look of your pushchair by choosing your favourite pattern fabric.Bugaboo custom accessories only for you.'),
(169, 1, 3, 'Accesorios Bugaboo Camaleon', '<h2 style=\"text-align:left;\"><strong>Accesorios Bugaboo Camaleon</strong> - únicos y originales, dale un toque chic a tu Bugaboo Camaleon.</h2>', 'accesorios-bugaboo-camaleon', 'Accesorios Bugaboo Camaleon - Teoyleo', '', 'Accesorios para cochecito Bugaboo Camaleon. Fundas manillar Bugaboo Camaleon, reposabrazos y bolsas para el respaldo, con tejidos de gran calidad.'),
(296, 1, 3, 'CUBRE CESTO PARA SILLA DE PASEO A MEDIDA', '<p>Tapa el cesto del carrito y mantén tu cesto cubierto y protegido de la lluvia y del polvo mientras paseas.</p>', 'cubre-cesto-para-silla-de-paseo-a-medida', 'Cubre cesta carro y silla de paseo', '', 'Mantén tu cesto cubierto y protegido de la lluvia y del polvo mientras paseas. Hecho a medida.'),
