(170, 1, 1, 'Bugaboo Cameleon Sets', '<p>Bugaboo tailored fabric set. Choose your favorite pattern fabric option to go with your bugaboo base. Give your stroller a new look and be unique.</p>', 'bugaboo-cameleon-sets', 'Personalized Bugaboo sets: Camaleon, Frog, Bee and Donkey - Teoyleo', 'bugaboo donkey tailored fabric set, bugaboo camaleon tailored fabric set, custom bugaboo camaleon, custom bugaboo, custom canopy bugaboo, custom apron bugaboo, custom set liner bugaboo, personalized bugaboo', 'Give your stroller a new look by changing the colors of your Bugaboo! Pop on one of our tailored fabric sets, and stroll stylishly away. Shipping all world'),
(170, 1, 3, 'Vestir Bugaboo Camaleon', '<h2 style=\"text-align:left;\"><strong>Viste tu Bugaboo Camaleon</strong> y expresa el poder de tu estilo personal!</h2>', 'vestir-bugaboo-camaleon', 'Vestir Bugaboo Camaleon - todo a juego para vestir tu Camaleon', '', 'Vestir Bugaboo Camaleon para que tu bebé este comodo y confortable dentro del cochecito. Elige tu tela favorita y personaliza tu Bugaboo Camaleon para que sea unico. Llevamos mas de 10 años confeccionando fundas para Bugaboo Camaleon con mucho love!'),
(170, 1, 4, 'Ensembles Bugaboo Cameleon', '<p> Pour customiser entièrement votre Bugaboo Cameleon : capote et housse longue assorties, à prix réduit !   Choisissez le tissu qui vous plaît le plus et nous vous confectionnerons sur mesure une housse longue et une capote pour votre Bugaboo Cameleon.</p>', 'ensembles-bugaboo-cameleon', 'Poussette Bugaboo accessoires personnalisés   ', 'Housse de poussette Bugaboo Cameleon, capote Bugaboo, housse Bugaboo, housses de bébé, housse tissu éponge Bugaboo', 'Personnalisez votre Bugaboo: capotes, housses, coussins d\'assise, tout pour votre poussette Bugaboo'),
(171, 1, 1, 'STOKKE', '<p>Personalized you Stokke stroller, with funky complements, chose your favorite pattern and we make it for you!</p>', 'stokke', 'Custom your stokke with our funky accessories, handmade by teoyleo', '', 'Handmade by Teoyleo in Spain, custom Stokke Stroller accessories. Chose your favorite pattern and will make it for you and your baby! Canopys, footmuff,..'),
(171, 1, 3, 'FUNDAS Y ACCESORIOS STOKKE', '<h2>Fundas Stokke - haz que tu carrito luzca único y diferente!</h2>', 'fundas-y-accesorios-stokke', 'Fundas Stokke - renueva tu carrito', 'silla Stokke, complementos silla Stokke, complementos Stokke, accesorios silla Stokke, accesorios Stokke, accesorios carro Stokke, sabana stokke, cubre pies stokke, cubre capazo stokke, capota stokke, funda sabana stokke, saco capazo stokke, saco stokke', 'Complementos para silla Stokke. Puedes elegir tu estampado favorito y personalizar al funda de la sabana, la capota, el cubre capazo. Tambien hacemos sacos.'),
(171, 1, 4, 'STOKKE', '<p>Que dites-vous de marquer la vôtre d\'une petite touche de chic? Si vous voulez vous donner un style différent, personnalisez votre poussette Stokke grâce à nos suggestions.</p>', 'stokke', 'Poussette Stokke accessoires personnalisés fait a main pour Teoyleo', 'stokke, poussette, fait a main', 'Poussette Stokke accessoires personnalisés pour Teoyleo, Personnalisez votre Stokke : capotes, housses,coussins d\'assise, tout pour votre poussette Stokke'),
