(173, 1, 3, 'CAPAZO STOKKE', '<p>Dale un toque chic a tu capazo Stokke con nuestras fundas de colchon y los cubre capazos, personalizados con tu estampado favorito.</p>', 'capazo-stokke', 'Fundas para capazo Stokke, sabanas personalizadas', 'capazo, capazo Stokke, funda sabana Stokke', 'Atrevete a que tu capazo Stokke sea unico y original! Te proponemos una personalizacion a tu gusto. Fundas y cubre capazos con tu estampado favorito.'),
