(181, 1, 4, 'Combi pilote et manteaux pour bébé', '', 'combi-pilote-et-manteaux-pour-bebe', 'combipilote bébé et manteaux pour bébé chaud et original', '', 'Combi pilote et manteaux pour bébé, tres chaud et confortable, parfait pour l\'hiver'),
(182, 1, 1, 'sin categoria', '', 'sin-categoria', '', '', ''),
(182, 1, 3, 'MUESTRAS TELAS', '<p>Sabemos lo dificil que es decidir entre todos los estampados que tenemos disponibles en nuestra tienda para personalizar tu producto favorito de Teoyleo. Por esa razón ofrecemos el servicio de muestras de telas.</p>', 'muestras-telas', 'Muestras de telas para confeccion de fundas y otros accesorios', '', 'Muestras de telas para que puedas ver en directo nuestros estampados y decidir cual de todos encaja mejor con tus gustos.'),
(182, 1, 4, 'sin categoria', '', 'sin-categoria', '', '', ''),
(184, 1, 1, 'Pacifier holder', '<p>Pacifier holder, you can Attach it to baby\'s pacifiers and teethers to keep them off the floor, Can be attached to belt loops, diaper bags and strollers. They are esigned to keep your child\'s pacifier clean and handy when needed.</p>', 'pacifier-holder', 'Pacifier holder,Attach to baby\'s pacifiers to keep them off the floor', NULL, 'Pacifier holder, you can Attach it to baby\'s pacifiers and teethers to keep them off the floor, Can be attached to belt loops, diaper bags and strollers'),
(184, 1, 3, 'Portachupetes', '<p>Para tener agarrado el mordedor, su juguete favorito o su chupete y evitar que se pierda.</p>', 'portachupetes', 'Portachupetes, accesorio indispensable para evitar perder el chupete', 'chupete, portachupete, tete, mordedor, portajuguetes', 'Portachupetes, accesorio indispensable para evitar que tu bebé pierda su chupete o cualquier juego que tenga entre las manos mientras lo paseas.'),
(184, 1, 4, 'Attache sucette ', '<p>L\'Attache sucette est une accessoire indispensable de bébé. L\'Attache Sucette permet aux parents de ne plus perdre la sucette de bébé.la tétine reste la fidèle compagne de bébé.Elle se fixe tout simplement sur les vêtements, bébé garde le sourire et la sucette reste propre !</p>', 'attache-sucette', 'Attache sucette Accessoire indispensable de bébé,Cadeau de naissance', NULL, 'Attache sucette Accessoire indispensable de bébé, Cadeau de naissance, L\'Attache Sucette permet aux parents de ne plus perdre la sucette de bébé.'),
(201, 1, 1, 'Baby gift pack', '<p>Baby gift packs, lovely sets for a newborn, we have the perfect present for a baby, great gift ideas for a newborn, have a look and you´ll find the present you are looking for!</p>', 'baby-gift-pack', 'Baby gift pack,lovely sets for a newborn,the perfect gift or present', '', 'Baby gift packs, lovely sets for a newborn,the perfect present, great gift ideas for a newborn, have a look and you´ll find the present you are looking for'),
(201, 1, 3, 'Set regalo bebe', '<p>Regalos para bebes, originales y únicos!</p>', 'set-regalo-bebe', 'Set regalo bebe - canastillas originales para regalar', '', 'Regalos para bebes originales. Ideas para que tu regalo sea divertido y unico. Sets para bebes, para celebrar con un regalo muy especial el nacimiento.'),
(201, 1, 4, 'Ensemble cadeau pour bébé', '<p>Ensemble cadeau pour bébé, Simpa coffret cadeau pour bébé ,Un cadeau original pour un nouveau-né</p>', 'ensemble-cadeau-pour-bebe', 'Ensemble cadeau pour bébé, simpa coffret cadeau pour bébé ', '', 'Ensemble cadeau pour bébé, simpa coffret cadeau pour bébé ,un cadeau original pour un nouveau-né'),
