(189, 1, 1, 'Baby Wipe Pouch', '<p>Lovely pouches to keep always perfect your baby´s wipes.</p>', 'baby-wipe-pouch', 'super cute Baby wipe pouch', '', 'Lovely pouches to keep always perfect your baby´s wipes.'),
(189, 1, 3, 'Porta toallitas bebé', '<h2>Estuches porta toallitas con diseños exclusivos. Para guardar las toallitas húmedas y llevarlas a mano.</h2>', 'porta-toallitas-bebe', 'Porta toallitas bebé con diseños originales - Teoyleo', 'toallitas bebé, accesorios originales bebé', 'Cansado de que las toallitas húmedas se sequen o pierdan por el bolso. Descubre los estuches porta toallitas de Teoyleo y enamorate!'),
