(190, 1, 3, 'Sacos de dormir', 'Preciosos sacos abrigados para que el bebé no se destape en la cama o en la hamaquita.\r\nLo puedes llevar también en el capazo.\r\nSiempre abrigado y a la moda!', 'sacos-de-dormir', 'Sacos de cuna para bebé,  calentitos y con libertad de movimiento', 'sacos dormir bebé, saco cuna bebé', 'Cómodos sacos de cuna para bebé de tirantes, el bebé estará siempre abrigado y con libertad de movimientos. Lo puedes usar en la hamaca y en el capazo.'),
