(191, 1, 4, ' Protège carnet de santé', '<p>Protège carnet de santé.<br />Indispensable pour conserver précieusement le carnet de vaccination de votre enfant ainsi que ses cartes.</p>', 'protege-carnet-de-sante', ' Protège carnet de santé', '', 'Protège carnet de santé de Mybags\r\nIndispensable pour conserver précieusement le carnet de vaccination de votre enfant ainsi que ses cartes.'),
