(193, 1, 1, 'COVERS BABYSITTERS', '<p>Bouncer cover.Cotton cover for babybjorn soft balance baby bouncer, Our covers are handmade with 100% super soft cotton fabric printed with colorfull prints! Chose your favorite!</p>', 'custom-cover-babysitter', 'Baby bjorn chair cover - handmade', 'babybjorn soft bouncer cover', 'Custom bouncer cover.Cotton cover for babybjorn soft balance baby bouncer, handmade with 100% super soft cotton with colorfull prints'),
(193, 1, 3, 'FUNDAS HAMACAS BABYBJORN', '<h2>Funda hamaca Babybjörn - un accesorio imprescindible</h2>', 'fundas-hamacas-babybjorn', 'Funda hamaca Babybjörn confeccionada a medida - Teoyleo', 'hamaca, hamaca babybjorn, babybjorn, funda babybjorn', 'Personaliza tu hamaca Babybjorn con nuestras fundas modernas y originales. Selecciona tu tela favorita de nuestro catálogo y renueva tu hamaca. '),
(193, 1, 4, 'HOUSSE POUR TRANSAT BÉBÉ', '<p>Housse pour le transat bébé fait a main avec coton, donne ta transat unique et différente avec nos tissus de coton imprimés et protège-la des taches!</p>', 'couvertures-transat', 'Couverture pour le transat bébé', 'transat babybjorn, couverture transat', 'Couverture, housse pour le transat bébé'),
(194, 1, 1, 'JANE', '<p>Custom your Jane with our handmade accessories for your stroller. Our Jane pushchair Accessories are as Unique as Your Baby! Canopies, footmuffs, full seat liner..what about giving to your Jane a diferent and classy touch? If you like to mark style and to differ, give to your baby chair a special look with our products!</p>', 'jane', 'Jane stroller, custom accesories unique like your baby', 'jane, concord, stroller, accesories, liner, canopy', 'Custom your Jane with accessories for your stroller. Custom Stroller Accessories as Unique as Your Child! Canopies, footmuffs, full seat liner..'),
(256, 1, 1, 'Footmuffs for Bugaboo Donnkey', '', 'footmuffs-for-bugaboo-donnkey', '', '', ''),
(194, 1, 3, 'FUNDAS JANE', '<h2>Fundas Jane - la metamorfosis definitiva de tu carrito!</h2>\n<p></p>', 'fundas-jane', 'Jane y Concord, personaliza tu silla.', 'jane, silla jane, silla jane rider, silla concord neo', 'Capotas y fundas para las sillas Jane y Concord. Elige tu estampado favorito y cambia el look de tu silla Jane y Concord. Accesorios únicos como tu bebé.'),
(194, 1, 4, 'JANE', '<p>Poussette Jane accessoires personnalisés fait a a main pour Teoyleo avec ton tissu de coton imprimé favorite, Personnalisez votre Jane :capotes,housses, chanceliére,tout pour votre poussette Jane</p>', 'jane', 'Poussette Jané accessoires personnalisés fair a main Teoyleo', 'poussette concord, poussette scout, poussette accesoires', 'Poussette Jane accessoires personnalisés pour Teoyleo,Personnalisez votre Poussette:capotes,housses, chanceliére,tout pour votre poussette Jane'),
(195, 1, 1, 'Cushion and linen for Stokke Xplory', '', 'cushion-stokke', 'Cushion Stokke Xplory', '', 'Cushion for Stokke Xplory strollers. Custom your Stokke Xplory'),
(195, 1, 3, 'FUNDAS STOKKE', '<h2>Renueva el look de tu silla Stokke con nuestras fundas y colchonetas.</h2>', 'fundas-stokke', 'Fundas para carro Stokke - confeccionadas a medida', 'stokke, colchoneta, funda Stokke', 'Nos dedicamos a coser fundas para los carritos Stokke. Usamos telas de algodon de alegres estampados. Disponibles online.'),
(195, 1, 4, 'TEXTILES POUSETTE STOKKE XPLORY ', '', 'textiles-pousette-stokke-xplory', '', '', ''),
(196, 1, 1, 'Sets Stokke Xplory', '', 'conjuntos-stokke-xplory', 'Stokke Xplory Sets to change the look of your Stokke Xplory chair.', '', ''),
(196, 1, 3, 'SETS STOKKE', '<p>Cambia por completo el estilo de tu silla Stokke Xplory. Confeccionamos para ti con tu estampado favorito capotas, sacos, fundas, cubrepies y muchos otros accesorios. Encuentra aqui tu set de capota, saco, funda, colchoneta y haz unico tu Stokke Xplory</p>', 'sets-stokke', 'Kit textil Stokke Xplory - con tu tela favorita', 'stokke, stokke xplory', 'Capotas, fundas, sabanas, cubrepies, sacos... todo lo que tu silla Stokke Xplory necesita para vestirla y cambiar el look de tu silla Stokke Xplory.'),
(196, 1, 4, 'Sets Stokke Xplory', '', 'conjuntos-stokke-xplory', 'Définit Stokke Xplory pour changer le look de votre chaise Stokke Xplory', '', ''),
(197, 1, 1, 'Baby Suitcases by Kiwisac', '<p>Baby Suitcases by Kiwisac</p>\n<p>Great soft lugagge baby suit cases by spanish brand Kiwisac</p>', 'baby-suitcases-by-kiwisac', 'Baby Suitcases by Kiwisac', NULL, 'Baby Suitcases by Kiwisac\r\n\r\nGreat soft lugagge baby suit cases by spanish brand Kiwisac'),
(197, 1, 3, 'Maletas Kiwisac', '<p>Bonitas maletas con estampados modernos e innovadores. Para llevar toda la ropa de tu bebé.</p>', 'maletas-kiwisac', 'Maletas bebé Kiwisac con estampados modernos.', 'maleta, kiwisac, estampado moderno, bebé', 'Maletas fabricadas en resistente nylon. Estampados modernos e innovadores de Kiwisac. Lleva toda la ropa de tu bebé y la tuya cuando salgais de viaje.'),
(197, 1, 4, ' Valises pour bébé par Kiwisa', '<p><br />Une valise pour bébé par Kiwisac, pour toutes les sorties et les voyages de bébé et maman.<br /><br />Un cadeau de nouveau-né utile et douce</p>', 'valises-pour-bebe-par-kiwisa', ' Valises pour bébé par Kiwisa', NULL, '\r\nValises pour bébé par Kiwisac, pour toutes les sorties et les voyages de bébé et maman.\r\n\r\nUn cadeau de nouveau-né utile et douce'),
(198, 1, 1, 'BABYMEL', NULL, 'babymel', NULL, NULL, NULL),
(198, 1, 3, 'BABYMEL', 'Bolsos modernos y elegantes Babymel', 'babymel', 'Bolsos para bebé Babymel', 'Babymel, bolso carro, bolso bebé', 'Bolsos modernos y elegantes de la marca Babymel. Combinan los colores para que lucan genial en tu carrito de bebé. Bolsos maternales grandes y prácticos.'),
