(200, 1, 1, 'MACLAREN PUSHCHAIR', '<p>Give a new look to your Maclaren pram with our accesories, handmade in Spain with high quality cotton fabrics.</p>', 'maclaren-pushchair', 'Maclaren pushchair accesories,canopy covers,cushions,handmade teoyleo', 'maclaren pushcahir, maclaren stroller, maclaren pram', 'Maclaren pushchair accesories, handmade stroller canopy, cushion, liners, custom your Maclaren pram, with our 100% beautifully printed cotton,chose the one'),
(200, 1, 3, 'FUNDAS MACLAREN', '<h2>Fundas y accesorios para la silla Mclaren</h2>', 'fundas-maclaren', 'Fundas Maclaren para personalizar tu silla.', '', 'Fundas Maclaren. Dale un look diferente a tu silla Maclaren con nuestros complementos, elige tu estampado favorito y personaliza tu capota, funda...'),
(200, 1, 4, 'MACLAREN POUSSETTE ', '<p>La gamme d\'accessoires fait a main pour Maclaren met en valeur votre poussette Des accessoires pour maclaren, faits aux mains et personnalisés avec le tissu qui te plaît plus. Capotes, coussin, Parfaits pour donne un nouveau look a votre poussette Maclaren.</p>', 'maclaren', 'Des accessoires personalisez Maclaren met en valeur votre poussette', 'maclaren poussette, maclaren capote, maclaren coussin', 'Des accessoires fait a main et personalisez pour Maclaren met en valeur votre poussette,et vous permettent de vous différencier et de vous balader avec style'),
(202, 1, 1, 'Jane footmuff', '<p>Footmuff for Jane stroller, handmade, perfect fit, super cosy and warm.</p>', 'jane-footmuff', 'Footmuff for Jane stroller, handmade, perfect fit, cosy and warm.', '', 'Footmuff for Jane stroller,handmade by teoyleo with your favorite fabric,choose one from our high quality cotton catalogue perfect fit, super cosy and warm'),
(202, 1, 3, 'Sacos Jane', '<h2 style=\"text-align:left;\"><strong>Sacos Jane</strong>, mima y abriga a tu bebé con tu estilo personal!</h2>', 'sacos-jane', 'Sacos Jane: sacos para sillas Jane unicos y diferentes', '', 'Sacos Jane, sacos para sillas de paseo Jane unicos y diferentes, tu marcas tu estilo. Nosotros hacemos el saco para que tu bebe este calentito y comodo.'),
(202, 1, 4, 'Chanceliére pour poussette Jane ', '<p>Personalisez votre chanceliere pour poussette Jane, Notre chancelières sont très douce et bien chaude. Fait a main pour teoyleo avec votre tissu favorite</p>', 'chanceliere-pour-poussette-jane-', 'Chanceliére pour poussette Jane personnalisez,très douce et  chaude', '', 'Personalisez votre chanceliere pour poussette Jane, Notre chancelières sont très douce et bien chaude. Fait a main pour teoyleo avec votre tissu favorite'),
(203, 1, 1, 'MAXI COSI - GRUPO 0', '<p>Accesories for Maxicosi car seat, canopy, liners, footmuffs, all the accesories you need for your maxi cosi!</p>', 'maxi-cosi', 'Accesories for Maxicosi car seat,canopy,liners,footmuffs handmade', 'maxi-cosi, maxicosi, maxi cosi, accesories for maxi cosi car seat', 'Accesories for Maxicosi car seat,canopy,liners,footmuffs, all the accesories for your maxi cosi! Select your favorite pattern and we´ll hanmade it for you!'),
(203, 1, 3, 'FUNDAS MAXI COSI - GRUPO 0', '<h2>Fundas a medida para maxi cosi y grupo 0</h2>', 'fundas-maxi-cosi-grupo-0', 'Sacos, fundas y capotas para tu maxicosi o grupo 0', '', 'Maxi cosi, sacos, fundas, capotas..., todos los accesorios para tu Maxi cosi. Para que tu silla Maxicosi luzca diferente y unica con tu estampado favorito.'),
(203, 1, 4, 'MAXI COSI - GROUPE 0', '<p>Accessoires pour maxi cosy, faire ta poussette unique et différente. Dans cette section tu pourras trouver des housses pour Maxi-Cosi, des sacs pour Maxicosi, des capotes pour la siege de auto max cosi, et beaucoup d\'autres compléments pour personnaliser ta siege de auto groupe 0 avec nos tissu de coton imprimés.</p>', 'maxi-cosi', 'Accessoires pour maxi cosy, faire ta poussette unique et différente', '', 'Accessoires pour maxi cosy, faire ta poussette unique et différente, housses pour maxi cosi, capote pour maxi cosi, chancelières pour poussette maxi cosi, '),
(204, 1, 1, 'Footmuff for  Maxi Cosi', '<p>Footmuff for Maxi Cosi or car seat group 0, You just have to chose your favorite cotton print from our catalogue and we\'ll make for your a super cozy and warm foot muff!</p>', 'footmuff-for-maxi-cosi', 'Footmuff for Maxi Cosi, chose your print and we\'ll make it for you', 'footmuff maxicosi, foot muff maxi cosy, cosey toe', 'Footmuff for  Maxi Cosi or car seat group 0, chose your favorite cotton print from our catalogue and we\'ll make for your a super cozy and warm foot muff!');
INSERT INTO `ps_category_lang` (`id_category`, `id_shop`, `id_lang`, `name`, `description`, `link_rewrite`, `meta_title`, `meta_keywords`, `meta_description`) VALUES
(204, 1, 3, 'Saco Maxi Cosi', '<h2 style=\"text-align:left;\"><strong>Saco Maxi Cosi</strong> para que tu bebé vaya calentito en su sillita Maxi Cosi o grupo 0.</h2>', 'saco-maxi-cosi', 'Saco Maxi Cosi mima a tu bebe con tu estilo personal ', '', 'Saco Maxi Cosi diferente. Tu eliges tu tela favorita, tenemos diferentes estampados: calaveras, geishas, superheroes... Tu Maxi Cosi con un estilo único!'),
(204, 1, 4, 'Chancelière pour Maxi Cosi', '<p>Chancelière pour Maxi Cosi ou siège auto.Ils sont sont très douce et bien chaude.</p>', 'chanceliere-pour-maxi-cosi', 'Chancelière pour Maxi Cosi.Ils sont sont très douce et bien chaude.', '', 'Chancelière pour Maxi Cosi ou siège d\'auto. Notre chancelières sont sont très douce et bien chaude. '),
(205, 1, 1, 'Covers and liners for Maxi Cosi and car seats', '<p>Covers and liners for Maxi Cosi or car seat group 0,chose your favorite print from our catalogue and we\'ll make for your a great and soft liner.</p>', 'covers-and-liners-for-maxi-cosi-and-car-seats', 'Covers and liners for Maxi Cosi and car seats, follow your style', NULL, 'Covers and liners for Maxi Cosi or car seat group 0,chose your favorite print from our catalogue and we\'ll make for your a great and soft liner, Teoyleo'),
(205, 1, 3, 'Fundas Maxi Cosi', '<p>Fundas Maxi cosi con tu estampado favorito. Fundas para proteger tu maxi cosi, o simplemente para mantenerlo limpio mas fácilmente. Fundas para Maxi Cosi adaptables para modelos como CabrioFix, Jane, Bebé Confort, Izi Sleep, Go...</p>', 'fundas-maxi-cosi', 'Fundas Maxi Cosi con tu tela favorita: calaveras, superheroes...', NULL, 'Fundas para Maxi Cosi, haz que la silla de tu bebé luzca siempre limpia y con un look moderno y desenfadado. Estampados diferentes, tejidos 100% algodon.'),
(205, 1, 4, 'HOUSSE POUR MAXI COSI ET SIEGE D´AUTO ', '<p>Housse pour Maxi Cosi ou siège d\'auto. Ils sont sont très confortables et belle. Elles s\'y ajustent parfaitement,fait a main avec ton coton imprimè favorite!</p>', 'housse-pour-maxi-cosi-et-siege-dauto', 'Housse pour Maxi Cosi. Ils sont sont très confortables et belle', NULL, 'Housse pour Maxi Cosi ou siège d\'auto. Ils sont sont très confortables et belle.Elles s\'y ajustent parfaitement,fait a main avec ton coton imprimè favorite'),
(206, 1, 1, 'Canopy for Maxi Cosi', '<p>Make your Maxi cosi or group 0 car seat a real eye-catcher with one of our cute canopies!</p>', 'canopy-for-maxi-cosi', 'Custom canopies maxi cosi or car seat grupe 0.Change your style ', NULL, 'Custom canopy for Maxi Cosi or car seat group 0,chose your favorite print from our catalogue and we\'ll make for your a great and unique canopy, Teoyleo'),
(206, 1, 3, 'Capota Maxi Cosi', '<p>Capotas para Maxi Cosi originales y únicas. Elige tu estampado favorito para que tu maxi cosi luzca moderno y diferente. Capotas para Maxi Cosi Cabriofix, Bugaboo, Jane, Bebe confort, Stokke Izi Sleep... elige tu modelo de maxi cosi o grupo 0.</p>', 'capota-maxi-cosi', 'Capota Maxi Cosi - elige tu tela favorita: calaveras, superheroes..', 'maxi cosi, capota maxi cosi', 'Capota para Maxi Cosi personalizada. Elige tu estampado favorito de nuestro catalogo y nosotros confeccionamos la capota para que se adapte a tu maxi cosi.'),
(206, 1, 4, 'Capote pour  Maxi Cosi', '<p>Capote pour Maxi Cosi ou siège d\'auto. Ils sont sont très originales et belle. Elles s\'y ajustent parfaitement,fait a main avec ton coton imprimè favorite</p>', 'capote-pour-maxi-cosi', 'Capote pour Maxi Cosi. Ils sont sont très originale et belle,teoyleo', NULL, 'Capote pour Maxi Cosi ou siège d\'auto. Ils sont sont très originales et belle.Elles s\'y ajustent parfaitement,fait a main avec ton coton imprimè favorite'),
