(207, 1, 3, 'Cubre Maxi Cosi', '<p>Cubre Maxi Cosi para cubrir tu silla maxi cosi o grupo 0. Elige tu estampado favorito y renueva tu silla Maxi Cosi con nuestros cobertores.</p>', 'cubre-maxi-cosi', 'Cubre Maxi Cosi. Elige tu tela favorita: calaveras, topos, rayas...', NULL, 'Cubre Maxi Cosi para cubrir tu silla Maxicosi Cabriofix, Bugaboo, Bebe confort... Cobertor para proteger del frio a tu bebé. Elige tu estampado favorito.'),
(207, 1, 4, 'Couverture pour Maxi Cosi', '<p>Couverture pour Maxi Cosi ou siège d\'auto. Ils sont sont très originales et belle.Elles s\'y ajustent parfaitement,fait a main avec ton coton imprimè favorite</p>', 'couverture-pour-maxi-cosi', 'Couverture pour Maxi Cosi. Ils sont sont très originale et belle,teoyleo', NULL, 'Couverture pour Maxi Cosi ou siège d\'auto. Ils sont sont très originales et belle.Elles s\'y ajustent parfaitement,fait a main avec ton coton imprimè favorite'),
(208, 1, 1, 'BORSINO BABY', '<p>Lovely and handmade products for your Borsino Baby Anne stroller, give to your baby pushchair a special look with our products! Canopy, footmuff, liner....everything for your Borsino!</p>', 'borsino-baby', 'Lovely and handmade products for your Borsino Baby Anne stroller', '', 'Lovely and handmade products for your Borsino Baby Anne stroller, Canopy, footmuff, liner....everything for your Borsino! Give a new look to your pushchair'),
(208, 1, 3, 'FUNDAS BORSINO BABY', '<h2>Fundas Borsino Baby - vestimos tu carrito y lo hacemos único</h2>', 'fundas-borsino-baby', 'Borsino Baby, fundas y accesorios personalizados', '', 'Textiles ajustados al carrito Anne de Borsino Baby. Elige tu tela favorita, chevron, calaveras, flores... y haz que tu silla Anne sea diferente y unica.'),
(208, 1, 4, 'BORSINO BABY POUSSETTE', '<p>Accesoires pour poussette Borsino Baby Anne. Que dites-vous de marquer la vôtre d\'une petite touche de chic? Si vous voulez vous donner un style différent, personnalisez votre poussette Borsino Baby Anne grâce à nos suggestions. Sélectionnez votre tissu préféré et nous le faisons</p>', 'borsino-baby-poussette', 'Poussette Borsino Baby Anne accessoires personnalisés ', '', 'Accesoires pour poussette Borsino Baby Anne, capote, housse.. Choisissez le motif qui vous plaît le plus pour donner une touche différente à votre poussett'),
