(5, 1, 5, ' PORTAZAGALES', 'Portabebes para llevar a tu bebé: mei tai, pouch, fular portabebes, bandoleras, pañuelos portabebes, mochilas portabebes...', 'portabebe', 'Mochila portabebes. Todos los modelos al mejor precio.', 'mei tai, mochila, portabebe, mochila portabebe, fular, bandolera', 'Portabebes para llevar a tu bebé cerca de ti. Fular portabebes, mei tai, bandolera portabebe, pouch, ect. Te asesoramos para que uses el mejor portabebes.'),
(6, 1, 5, ' Mei tai', 'Un mei tai es una mochila portabebé de tela. El origen del diseño de esta curiosa mochila portabebé, viene del sur de china, donde las madres que trabajan en los campos de arroz, llevan a sus hijos a la espalda, atados con unas bonitas telas llamadas beidao o mei tai.', 'mei-tai', 'Mei tai - portabebe ergonomico para portear a tu bebé con seguridad', 'mei tai, mochila, portabebe, mochila portabebe', 'Personaliza tu mei tai. Con un mei tai puedes portear a tu bebé hasta los 3 años. Elige tu estampado y color favorito y customiza tu mei tai. Envio gratis.'),
(10, 1, 5, 'EMBARAZO Y LACTANCIA', 'Productos utiles y practicos para usar durante el embarazo y la lactancia.', 'lactancia-materna', 'Lactancia materna, extractores leche materna Medela - Teoyleo', 'dar el pecho, dar la teta, LM, lactancia materna, sacaleches, extractor leche materna, amamantar, teta y bebé', 'La lactancia materna es el mejor regalo que puedes hacer a tu bebé. Aqui podras encontrar practicos articulos para facilitar la lactancia natural.'),
(11, 1, 5, ' Sacaleches', '¿Que es un sacaleches? Un sacaleches es un aparato que sirve para ayudar a la madre a extraer la leche del pecho. También se llaman extractores de leche materna. Pueden ser manuales o eléctricos.', 'sacaleches', 'Sacaleches o extractores de leche materna de Medela', 'lactancia, sacaleches, extractor leche materna, leche materna, amamantar, dar el pecho, mastitis, medela, comprar sacaleches', 'Descubre los sacaleches mas respetuosos con la lactancia: sacaleches de Medela. Gastos de envio gratis y regalo exclusivo.'),
(12, 1, 5, ' Accesorios LM', 'Practicos accesorios para utilizar durante la lactancia materna.', 'accesorios-lactancia-materna', 'Bolsas para almacernar leche materna', 'Conservacion leche materna, almacenar leche, congelar leche, congelar LM', 'Practicas bolsas para almacenar y conservar la leche materna.'),
(13, 1, 5, ' PARA COMER', 'Articulos para cuando ya comen', 'alimentacion-bebe', 'Articulos para facilitar la alimentacion de los peques', 'trona, babero, alimentacion bebe, alimentacion, vasos bebe', 'Articulos originales y practicos para bebes'),
(14, 1, 5, ' PARA LA SILLA DE PASEO', 'Todos los accesorios para el carrito', 'sillita-bebe-diferente', 'Bolsos maternales, sacos, colchonetas, etc, todo para el carro del bebe', 'bolsos maternales, cambiadores, sacos silla, colchonetas silla, carro bebé', 'Personaliza tu sillita de paseo! Entra y descubre nuestros bolsos maternales, sacos, colchonetas, capotas, y mas accesorios para que tu silla sea única!'),
(15, 1, 5, 'BEBES PRODUCTOS ORIGINALES', 'Todos los productos de teoyleo.com cosidos A mano\r\nLos que diseñamos nosotras y los que  diseñas tú.\r\n', 'a-mano', 'Productos para el bebé cosidos A mano', 'bebés, mei tai, arrullos, bolsos, cambiadores, baberos', 'Elige las telas para que cosamos las cosicas de teoyleo.com segun tu estilo. Todo para el bebé único y original.'),
(16, 1, 5, ' REGALOS', 'Regalos originales para una crianza natural.', 'regalo-bebe', 'Regalos originales y practicos para bebes y mamas', 'regalo original bebe, regalo bebe, regalo nacimiento, pack nacimiento, canastilla, cesta nacimiento', 'Regalos originales para una crianza natural. Si estas cansado del tipico celeste y rosa entra y te sorprenderemos.'),
