(23, 1, 5, 'Stokke', 'Capotas para silla de paseo Stokke, elige la tela que mas te guste y nosotros te confeccionamos la capota para tu carro Stokke.', 'capotas-stokke', 'Capotas con original diseño adaptadas a silla Stokke', 'Personaliza tu sillita Stokke con estas originales capotas', 'Capotas para silla de paseo Stokke'),
