(27, 1, 5, ' Patucos', 'Zapatos para los bebés cosidos artesanalmente A mano.', 'patucos', 'Patucos cosidos A mano.', 'Patucos, zapatitos, bebé, originales, artesania', 'Patucos modernos para bebes recien nacidos. Elige tu estampado favorito y confeccionamos los patucos de tu bebé a medida. Un regalo original para bebes.'),
