(37, 1, 5, 'Mei tai', 'La estrella de teoyleo, nuestros Portazagales, lleva a tu bebé encima y disfruta.', 'portazagales', 'Portazagales', 'portabebe, meitai, foulard, pouch, bandolera', 'Portabebes, meitai, foulard, todo de Teoy Leo y cosido A mano.'),
(39, 1, 5, 'Kit de supervivencia cosido A mano', 'El kit de supervivencia es un practico y moderno botiquin donde podrás guardar los principales medicamentos y accesorios que pueda necesitar tu bebé. Dentro del kit puedes guardar: unas tijeritas, un termometro, un antitermico, unas gasas y una jeringilla para administrar el antitermico.\r\n\r\n', 'kit-de-supervivencia-cosido-a-mano', 'Kit de supervivenci: botiquin cómodo y moderno.', 'botiquin, neceser, bebé, antitermico', 'EL kit de supervivencia es un pequeño neceser en el que puedes guardar los básicos de tú botiquin, y cabe en tu bolso.'),
(40, 1, 5, 'Diseña tu Kit de supervivencia.', 'Aqui tienes algo realmente practico: el kit de supervivencia!\r\n\r\nEl kit de supervivencia es un practico y moderno botiquin donde podras guardar los principales medicamentos y accesorios que pueda necesitar tu bebe. Dentro del kit puedes guardar: unas tijeritas, un termometro, un antitermico, unas gasas y una jeringilla para administrar el antitermico.\r\n', 'disena-tu-kit-de-supervivencia', 'Diseña tú kit de supervivencia.', 'botiquin, kit de supervivencia, personalizar, neceser', 'El botiquin perfecto, diseñado según tú estilo. Un pequeño neceser en el que guardarás todo lo necesario.'),
(42, 1, 5, 'Bolsitos cambiadores cosidos A mano.', 'Cambiadores de preciosos colores, con el tamaño exacto para que los lleves en el bolso.', 'bolsitos-cambiadores-cosidos-a-mano', 'Bolsitos cambiaodres cosidos A mano.', 'cambiadores, modernos, comodos aresania', 'Cambiadores, cosidos a mano y con el tamaño exacto para guardar 2 pañales y un paquete de toallitas.'),
(43, 1, 5, 'Diseña tu bolsito cambiador.', 'Si no te gusta ninguno de nuestros cambiadores, diseña el tuyo!!', 'disena-tu-bolsito-cambiador', 'Diseña tu bolsito cambiador.', 'cambiadores personalizados, modernos, comodos, utiles', 'Cambiadores personalizados, cosidos a mano y con el tamaño exacto para guardar 2 pañales y un paquete de toallitas.'),
(44, 1, 5, 'Patucos cosidos A mano.', 'Zapatitos para los niños de preciosos diseños y comodisimos. Cosidos a mano en algodón y minkee, prefectos para cuando no andan y geniales par air por casa.', 'patucos-cosidos-a-mano', 'Patucos cosidos A mano.', 'patucos, zapatos originales comodos', 'Patucos unicos y originales para los bebés. Cosidos a mano y de preciosos diseños.'),
(45, 1, 5, 'Diseña tus patucos', 'Si no te gusta ninguno de nuestros modelos, diseña tus propios patucos.', 'disena-tus-patucos', 'Diseña tus patucos.', 'patucos personalizados, originales, unicos zapatitos bebe', 'Patucos unicos y originales para los bebés. Elige la tela que más te gute y nosotras cosemos tus patucos.'),
(48, 1, 5, 'PARA REGALAR', 'Regalos originales y prácticos para bebes y recien nacidos.', 'regalos-originales-bebes', 'Regalos originales y prácticos para bebes y recien nacidos.', 'regalo original, arrullo, arrullo bebé, manta bebé', 'Regalos para bebes utiles, practicos, originales y sobre todos únicos como tu bebé. Muchos de los productos de nuestra tienda solo podras encontrarlos aqui.'),
(49, 1, 5, 'Babylegs', 'Los BABY LORCITAS son unos calentadores preciosos para los bebés y sus padres. Hechos de un tejido suavecito.\r\nAdemás como todos los productos de TEOYLEO.COM el diseño es importantisimo, único y original.\r\n\r\n\r\n', 'babylegs', 'Baby lorcitas, baby legs de diferentes modelos.', 'babylegs, calentadores bebe, ropa bebe, quitar pañal.', 'Baby legs de colores'),
(50, 1, 5, 'Bodys', 'Bodys de algodón, con detalles bordados con mucha personalidad.', 'bodys', 'Bodys algodón, únicos y originales.', 'Bodys algodon, ropa de bebé original,bodies, body, onesie, ', 'Bodys de algodón, con diseños originales bordados, motivos únicos y vistosos. Nada será lo mismo.'),
(51, 1, 5, ' Cheques regalo', 'Cuando nace un bebé, nunca sabes como acertar con el regalo. Con el cheque regalo de teoyleo, es imposible fallar.', 'cheques-regalo', 'Cheque regalo Teoyleo, un regalo de nacimiento original y que nunca falla.', 'Cheques regalo, regalo bebé, regalo madre, cestas nacimiento, regalo nacimiento, canastilla,', 'eL REGALO PERFECTO PARA UNOS PADRES Y SU BEBÉ, IMPOSIBLE FALLAR. UNICO Y ORIGINAL.'),
(52, 1, 5, 'Cestas regalo', 'Elíge tus productos favoritos de teoyleo.com y metelos en una cesta. El regalo perfecto.', 'cestas-regalo', 'Cestas regalo teoyleo.com', 'canastillas, cestas regalo bebé', 'Canastillas de bebé, o cestas a medida para regalar a los bebés y sus papás.'),
(55, 1, 5, 'Pouch Lodger Shelter', 'Una idea genial!! Un portabebés en tejido polar o algodón que tambien puedes usarlo en la sillita del coche.', 'pouch-lodger-shelter', 'Portabebe pouch shelter lodger', 'pouch, portabebe, saco silla, grupo 0', 'Un portabebé que es pouch y sirve para la silla del coche.'),
(58, 1, 5, ' Bolsito Riñonera', 'Un bolso para llevar a la cintura o cruzado al hombro como bandolera. Muy util cuando sales con tu mochila portabebe para seguir teniendo las manos libres.\r\nDiseño practico, original e innovador.', 'bolsito-rinonera', 'bolsito de cintura', 'riñonera, bandolera, bolso, bolsito, funny pack', 'Riñonera: practico y moderno bolsito para llevar en la cintura o al hombro'),
