(133, 1, 5, 'Bolsas merienda o snack', 'Cómodas y originales bolsitas en forma de sobre perfectas para guardar la merienda o el snack de tu hij@.\r\nLas puedes llevar en tu bolso o podrá utilizarla para llevar el almuerzo al colegio.', 'bolsas-merienda-mybags', 'Bolsa para guardar comida. De nylon impermeable. Usala con tu bebé!', 'bolsa snack almuerzo bebé niño', 'Bolsas con estampados de buhos, vespas retro... Lleva tu comida y la de tu pequeño en una bolsa con estilo moderno. Es impermeable y se cierra con velcro.'),
(134, 1, 5, 'Bolsas multiusos Mybags', 'Prácticas bolsitas multiuso. Perfectas para llevar la muda de tu peque cuando sales a pasear.', 'bolsas-muda-mybags', 'Bolsa estanca, estampados modernos. Usala tú y tu bebé! de My Bag´s', 'bolsas multiusos bolsas muda bebé', 'Pequeñas bolsas impermeables, modernas y divertidas, para guardar los juguetes o el almuerzo del bebé, de la marca My Bag´s. Elige tu estampado favorito!'),
