(144, 1, 5, 'COSMÉTICA BEBÉS Y MAMÁS', 'Cosmética natural y ecológica, 100% principios activos Bio.', 'cosmetica', 'Cosmetica natural para los bebes, aceites y cremas naturales.', 'cosmetica bebé', 'Cosmetica natural y 100% certificada bio para tu piel y la de tu bebé. Aceites y cremas para dar a la piel un aspecto suave y sedoso. Fabricado en España.'),
