(168, 1, 5, 'Capazo Bugaboo', 'Personaliza tu silla Bugaboo con originales y unicos estampados. Haz que tu bugaboo sea el captador de todas las miradas!', 'capazo-bugaboo', 'Capazo Bugaboo, hazlo único con nuestras fundas modernas - Teoyleo', 'sacos para capazo, capazo bugaboo camaleon, sacos capazo bugaboo, cubre capazo, cubrepies camaleon, cubrepies bugaboo, cubrepies donkey, cubre capazo donkey, cubre capazo camaleon, funda capazo, accesorios bugaboo, cubre coches bugaboo, cubre cuco bugaboo', 'Tu capazo Bugaboo con originales estampados. Personaliza tu silla bugaboo para que sea el captador de todas las miradas! Exclusivos y modernos diseños.'),
(169, 1, 5, 'Accesorios Bugaboo', 'Accesorios unicos y originales para dar un toque chic a tu silla Bugaboo.', 'accesorios-bugaboo', 'Accesorios Bugaboo para tu silla Bugaboo, Bee y Donkey - Teoyleo', 'cubre cinturones personalizados, accesorios bugaboo, accesorios camaleon, accesorios donkey, accesorios bee, funda reposabrazos Bugaboo, funda manillar Bugaboo, accesorios bugaboo camaleon online, bugaboo camaleon accesorios, accesorios originales bebes', 'Accesorios modernos y unicos para personalizar tu silla Bugaboo Camaleon, Donkey y Bee. Funda para el manillar, cubre cinturones personalizados, reposabrazos'),
