(26, 1, 6, ' Tronas', 'Tronas de tela: para sentar al bebe en cualquier silla.', 'tronas', 'Tronas de tela: para sentar al bebe en cualquier silla.', 'trona tela, trona plegable, trona portatil, trona bebe, trona, asiento bebé', 'Trona de tela: para llevar en el bolsillo y poder sentar a tu bebé en cualquier silla.'),
(27, 1, 6, ' Patucos', 'Zapatos para los bebés cosidos artesanalmente A mano.', 'patucos', 'Patucos cosidos A mano.', 'Patucos, zapatitos, bebé, originales, artesania', 'Patucos modernos para bebes recien nacidos. Elige tu estampado favorito y confeccionamos los patucos de tu bebé a medida. Un regalo original para bebes.'),
(31, 1, 6, ' Baberos', 'Baberos un complemento que viste!', 'baberos', 'Baberos prácticos y bonitos.', 'Baberos, plastificados, artesania, personalizados', 'Baberos de algodón y plastificados. Útiles y originales.'),
(32, 1, 6, ' Bolsitos cambiadores', 'La solución a los pañales. Un cambiador que cabe en tú bolso. Tamaño justo para cambiar al bebé en cualquier superficie y dentro cabe justo 2 pañales y las toallitas.', 'bolsitos-cambiadores', 'Bolsitos cambiadores, de diseños originales y muy útiles. ', 'cambiadores, pañales, artesania, practicos', 'Preciosos cambiadores cosidos a mano, con diseños únicos, comodos y prácticos.'),
(33, 1, 6, ' Kit de supervivencia', 'Pequeño botiquin perfecto para guardar las cosas básicas de tu bebé. Ten todo A mano', 'kit-de-supervivencia', 'Kit de supervivencia: pequeño botiquin, cómodo y original.', 'kit de supervivencia, botiquin, neceser, antitermico, bebé', 'Botiquin, neceser en el que puedes guardar todo lo necesario para tu pequeño.'),
(34, 1, 6, ' Bodys', 'Bodys de algodón, con detalles bordados con mucha personalidad.', 'bodys', 'Bodys algodón, únicos y originales.', 'Bodys algodon, ropa de bebé original', 'Bodys de algodón, con diseños originales bordados, motivos únicos y vistosos. Nada será lo mismo.'),
(35, 1, 6, ' Bolsos maternales', 'Bolsos universales para cualquier sillita y hombro.\r\n', 'bolsos-maternales-teoyleo', 'Bolsos maternales de originales diseños.', 'bolsos maternales, bolsos carro, Bolsos, pañales, papillas, ropita bebé, carro', 'Bolsos originales y practicos para llevar en la sillita o de viaje'),
(36, 1, 6, 'Stokke ', 'Personaliza tu sila Stokke, cámbiale la capota, dale color a sus fundas, personaliza el capazo de tu Stokke. Haz tu carro Stokke diferente y original.\r\n', 'silla-stokke', 'Stokke, personaliza tu silla stokke para que sea única', 'carro stokke, silla stokke, stokke, stokke bebe, personalizar stokke, carrito bebe stokke, capota stokke, stokke original, stoke, funda stokke, silla bebe', 'Personaliza tu silla Stokke, cámbiale la capota, dale color a sus fundas, personaliza el capazo de tu Stokke. Haz tu carro Stokke diferente y original.'),
(37, 1, 6, 'Mei tai', 'La estrella de teoyleo, nuestros Portazagales, lleva a tu bebé encima y disfruta.', 'portazagales', 'Portazagales', 'portabebe, meitai, foulard, pouch, bandolera', 'Portabebes, meitai, foulard, todo de Teoy Leo y cosido A mano.'),
(39, 1, 6, 'Kit de supervivencia cosido A mano', 'El kit de supervivencia es un practico y moderno botiquin donde podrás guardar los principales medicamentos y accesorios que pueda necesitar tu bebé. Dentro del kit puedes guardar: unas tijeritas, un termometro, un antitermico, unas gasas y una jeringilla para administrar el antitermico.\r\n\r\n', 'kit-de-supervivencia-cosido-a-mano', 'Kit de supervivenci: botiquin cómodo y moderno.', 'botiquin, neceser, bebé, antitermico', 'EL kit de supervivencia es un pequeño neceser en el que puedes guardar los básicos de tú botiquin, y cabe en tu bolso.'),
(40, 1, 6, 'Diseña tu Kit de supervivencia.', 'Aqui tienes algo realmente practico: el kit de supervivencia!\r\n\r\nEl kit de supervivencia es un practico y moderno botiquin donde podras guardar los principales medicamentos y accesorios que pueda necesitar tu bebe. Dentro del kit puedes guardar: unas tijeritas, un termometro, un antitermico, unas gasas y una jeringilla para administrar el antitermico.\r\n', 'disena-tu-kit-de-supervivencia', 'Diseña tú kit de supervivencia.', 'botiquin, kit de supervivencia, personalizar, neceser', 'El botiquin perfecto, diseñado según tú estilo. Un pequeño neceser en el que guardarás todo lo necesario.'),
(42, 1, 6, 'Bolsitos cambiadores cosidos A mano.', 'Cambiadores de preciosos colores, con el tamaño exacto para que los lleves en el bolso.', 'bolsitos-cambiadores-cosidos-a-mano', 'Bolsitos cambiaodres cosidos A mano.', 'cambiadores, modernos, comodos aresania', 'Cambiadores, cosidos a mano y con el tamaño exacto para guardar 2 pañales y un paquete de toallitas.'),
(43, 1, 6, 'Diseña tu bolsito cambiador.', 'Si no te gusta ninguno de nuestros cambiadores, diseña el tuyo!!', 'disena-tu-bolsito-cambiador', 'Diseña tu bolsito cambiador.', 'cambiadores personalizados, modernos, comodos, utiles', 'Cambiadores personalizados, cosidos a mano y con el tamaño exacto para guardar 2 pañales y un paquete de toallitas.'),
(44, 1, 6, 'Patucos cosidos A mano.', 'Zapatitos para los niños de preciosos diseños y comodisimos. Cosidos a mano en algodón y minkee, prefectos para cuando no andan y geniales par air por casa.', 'patucos-cosidos-a-mano', 'Patucos cosidos A mano.', 'patucos, zapatos originales comodos', 'Patucos unicos y originales para los bebés. Cosidos a mano y de preciosos diseños.'),
(45, 1, 6, 'Diseña tus patucos', 'Si no te gusta ninguno de nuestros modelos, diseña tus propios patucos.', 'disena-tus-patucos', 'Diseña tus patucos.', 'patucos personalizados, originales, unicos zapatitos bebe', 'Patucos unicos y originales para los bebés. Elige la tela que más te gute y nosotras cosemos tus patucos.'),
(48, 1, 6, 'PARA REGALAR', 'Regalos originales y prácticos para bebes y recien nacidos.', 'regalos-originales-bebes', 'Regalos originales y prácticos para bebes y recien nacidos.', 'regalo original, arrullo, arrullo bebé, manta bebé', 'Regalos para bebes utiles, practicos, originales y sobre todos únicos como tu bebé. Muchos de los productos de nuestra tienda solo podras encontrarlos aqui.'),
(49, 1, 6, 'Babylegs', 'Los BABY LORCITAS son unos calentadores preciosos para los bebés y sus padres. Hechos de un tejido suavecito.\r\nAdemás como todos los productos de TEOYLEO.COM el diseño es importantisimo, único y original.\r\n\r\n\r\n', 'babylegs', 'Baby lorcitas, baby legs de diferentes modelos.', 'babylegs, calentadores bebe, ropa bebe, quitar pañal.', 'Baby legs de colores'),
(50, 1, 6, 'Bodys', 'Bodys de algodón, con detalles bordados con mucha personalidad.', 'bodys', 'Bodys algodón, únicos y originales.', 'Bodys algodon, ropa de bebé original,bodies, body, onesie, ', 'Bodys de algodón, con diseños originales bordados, motivos únicos y vistosos. Nada será lo mismo.'),
(51, 1, 6, ' Cheques regalo', 'Cuando nace un bebé, nunca sabes como acertar con el regalo. Con el cheque regalo de teoyleo, es imposible fallar.', 'cheques-regalo', 'Cheque regalo Teoyleo, un regalo de nacimiento original y que nunca falla.', 'Cheques regalo, regalo bebé, regalo madre, cestas nacimiento, regalo nacimiento, canastilla,', 'eL REGALO PERFECTO PARA UNOS PADRES Y SU BEBÉ, IMPOSIBLE FALLAR. UNICO Y ORIGINAL.'),
(52, 1, 6, 'Cestas regalo', 'Elíge tus productos favoritos de teoyleo.com y metelos en una cesta. El regalo perfecto.', 'cestas-regalo', 'Cestas regalo teoyleo.com', 'canastillas, cestas regalo bebé', 'Canastillas de bebé, o cestas a medida para regalar a los bebés y sus papás.'),
(55, 1, 6, 'Pouch Lodger Shelter', 'Una idea genial!! Un portabebés en tejido polar o algodón que tambien puedes usarlo en la sillita del coche.', 'pouch-lodger-shelter', 'Portabebe pouch shelter lodger', 'pouch, portabebe, saco silla, grupo 0', 'Un portabebé que es pouch y sirve para la silla del coche.'),
(58, 1, 6, ' Bolsito Riñonera', 'Un bolso para llevar a la cintura o cruzado al hombro como bandolera. Muy util cuando sales con tu mochila portabebe para seguir teniendo las manos libres.\r\nDiseño practico, original e innovador.', 'bolsito-rinonera', 'bolsito de cintura', 'riñonera, bandolera, bolso, bolsito, funny pack', 'Riñonera: practico y moderno bolsito para llevar en la cintura o al hombro'),
(59, 1, 6, 'Bolsos cambiadores', 'Prácticos bolsitos cambiadores para cambiar el pañal de tu bebe cuando sales de casa.', 'bolsos-cambiadores', 'Bolsos cambiadores modernos para tu bebé', 'cambiador, cambiador bebe, bolso pañal, bolso bebé, bolso bebe, bebe, pañal, cambia pañal', 'Prácticos bolsitos cambiadores para cambiar el pañal de tu bebe cuando sales de casa.'),
(60, 1, 6, ' Otros accesorios', 'Accesorios practicos y originales para el paseo de tu bebé.', 'otros-accesorios', 'Accesorios divertidos y practicos para tu bebé.', 'accesorios bebé, toallitas, bebé, dispensador toallitas', 'Accesorios practicos para la sillita de tu bebé'),
(61, 1, 6, 'Muñeco Lactante', 'Bebe lactante que ayuda a normalizar la lactancia materna desde la infancia.', 'bebe-gloton', 'Muñeco Lactante Bebe Gloton', 'Bebe gloton, muñeco lactante, muñeco amamanta, bebe lactante, bebe lactanica', 'Bebe lactante que ayuda a normalizar la lactancia materna desde la infancia. Bebe Gloton.'),
(62, 1, 6, 'Rodilleras de gateo', 'Para bebes gateadores ahora tenemos estas preciosas rodilleras para que tu bebe no se lastime las rodillas. ', 'rodilleras-de-gateo', 'Rodilleras de gateo para bebes', 'rodilleras, gateo, bebé, gatear, babylegs, kallekryp,', 'Rodilleras para bebes gateadores, para que tu bebé no se lastime las rodillas.'),
