(93, 1, 6, 'Personaliza tu propio mei tai', 'Elige las telas que mas te gusten y diseñate tu mei tai como mas te guste.', 'portabebes-mei-tai', 'Mei tai customizable, tu lo diseñas!', 'mei tai, mai tai, portabebe, portabebes, mochila portabebe, pouch, babyhawk, sling, baby carrier', 'Mochila portabebe mei tai  especial y u n i c a como tu bebe. Diseñala a tu gusto.'),
(94, 1, 6, 'Protector de cinturon', '¿Estas aburrido de las correas del asiento de coche de tu hijo?\r\nNuestros protectores para cinturones estan acolchados y son de un tamaño adecuado para proteger la delicada piel de tu bebé.', 'protector-cinturon-bebe', 'Protector para cinturon de bebé.', 'protector cinturon bebe, protector cinturon, funda correa bebe, funda correa', 'Fundas protectoras para que tu bebé no se dañe con los cinturones de seguiridad de la silla o del coche.'),
