(156, 1, 6, 'Saco Kimono bebé', 'Saco bebe con forma de kimono. Abriga a tu bebé con estilo!', 'saco-kimono-bebe', 'Saco Kimono bebé, para abrigar con estilo a tu bebé - Teoyleo', 'saco dormir bebe, kimono', 'Saco kimono para abrigar a tu bebe desde el nacimiento hasta los 9 meses. Practico y alternativo, un regalo original para mantener calentito a tu bebé.'),
(157, 1, 6, 'Bolsos bebé Kiwisac', 'Los bolsos Kiwisac son modernos y alternativos, para padres originales y practicos.', 'bolsos-bebe-kiwisac', 'Kiwisac, prácticos bolsos para llevar todas las cosas de tu bebé.', 'Kiwisac, bolsos Kiwisac, bolso bebé, bolso carro Kiwisac, bolso silla, Kiwisac online, Kiwisac piratas, Kiwisac lisitapo, Kiwisac anai, Kiwisac family, bolso maternidad Kiwisac', 'Los bolsos Kiwisac estan diseñados en España y pensados para padres practicos y modernos. Los colores de estos bolsos de bebé son alegres y diferentes!'),
(158, 1, 6, 'Cambiador bebé Kiwisac', 'Cambiadores originales y divertidos de la marca española Kiwisac.', 'cambiador-bebe-kiwisac', 'Kiwisac, cambiador bebé para cambiar el pañal en cualquier lugar.', 'cambiador, kiwisac, cambiador bebé', 'Por su tamaño y diseño los cambiadores Kiwisac son ideales para usarlos en el cambio diario del pañal del bebé. Cambiadores modernos y practicos como tu!'),
(159, 1, 6, 'Portachupetes bebé Kiwisac', 'Guarda el chupete de tu bebé en estos prácticos y modernos portachupetes de Kiwisac.', 'portachupetes-bebe-kiwisac', 'Kiwisac, portachupetes de bebé moderno y alternativo - Teoyleo', 'portachupetes, chupete, Kiwisac', 'El chupete de tu bebé siempre acaba perdido? Guardalo en estos portachupetes de la marca española Kiwisac. Con diseños divertidos y originales. En stock.'),
(160, 1, 6, 'Portadocumentos bebé Kiwisac', 'Originales carteras portadocumentos de Kiwisac, para guardar todos los papeles del médico de tu bebé.', 'portadocumentos-bebe-kiwisac', 'Portadocumentos Kiwisac para guardar todos los papeles de tu bebé.', 'cartera, portadocumentos, kiwisac', 'Originales carteras portadocumentos de Kiwisac, para guardar todos los papeles del médico de tu bebé. Todo en orden de manera facil y sencilla! En stock.'),
(161, 1, 6, 'Mochilas bebé Kiwisac', 'Divertidas y originales mochilas de Kiwisac para llevar la merienda de tu bebé.', 'mochilas-kiwisac', 'Divertidas mochilas de Kiwisac para llevar la merienda de tu bebé.', 'mochila, mochila merienda cole, kiwisac', 'Mochilas Kiwisac, diseño divertido y moderno, para llevar al cole, la guarderia o al parque y poder guardar la merienda y los juguetes de los mas pequeños.'),
(162, 1, 6, 'Bolsitas impermeables Kiwisac', 'Bolsitas impermeables de Kiwisac, para guardar los juguetes o un sandwich.', 'bolsitas-impermeables-kiwisac', 'Bolsitas impermeables de Kiwisac para llevar la merienda - Teoyleo', 'bolsa, bolsita, merienda bebé, Kiwisac', 'Por su tamaño estas bolsas impermeables son geniales para llevar la merienda de tu bebé. Fantasticos diseños de Kiwisac. Cierre con cremallera. En stock.'),
(163, 1, 6, 'fatquarters costurika', NULL, 'fatquarters-costurika', NULL, NULL, NULL),
(164, 1, 6, 'bolso panera', NULL, 'bolso-panera', NULL, NULL, NULL),
(165, 1, 6, 'BUGABOO', 'Accesorios únicos y diferentes para los diferentes modelos de la silla Bugaboo. Haz que tu silla Bugaboo Camaleon, Bugaboo Buffalo, Bugaboo Bee o Bugaboo Donkey se distinta del resto. Elige tu estampado favorito víste tu silla Bugaboo con estilo. Tenemos fundas para capazo, fundas sabanas del colchoncillo del capazo, capotas Bugaboo normales y extensibles, fundas para las sillas de paseo, fundas para la barra apoyabrazos del bebé y tambien fundas para el manillar de la silla Bugaboo. Customizamos cualquier accesorio Bugaboo!', 'bugaboo', 'Fundas Bugaboo, capotas Bugaboo, accesorios Bugaboo. Hazlo unico!', 'bugaboo, funda silla bugaboo camaleon, bugaboo camaleon, capota bugaboo, funda bugaboo, fundas de bebe, funda rizo bugaboo, funda bee, capota bee, accesorios bugaboo, complementos bugaboo, personaliza bugaboo, funda bugaboo donkey, capota bugaboo donkey', 'Accesorios Bugaboo. Haz diferente tu silla Camaleon, Bee, Buffalo o Donkey. Elige tu estampado favorito y personaliza tu capota, funda o capazo Bugaboo.'),
(166, 1, 6, 'Capotas Bugaboo', 'Capotas con estilo para el Bugaboo Camaleon y el Bugaboo Bee', 'capotas-bugaboo', 'Capotas originales y divertidas para tu Bugaboo Camaleon y Bee', 'capota bugaboo, capota bugaboo camaleon, capota bugaboo bee, capota para bugaboo, capotas bugaboo personalizadas, funda capota bugaboo', 'Cambia el estilo de tu Bugaboo con nuestras originales capotas. Tenemos 100 estampados diferentes, elige tu favorito y haz que tu Bugaboo luzca diferente.'),
(167, 1, 6, 'Fundas Bugaboo', 'Marca un estilo diferente, distingue tu silla Bugaboo utilizando fundas personalizadas. ', 'fundas-bugaboo', 'Fundas Bugaboo, cambia el textil de tu silla Bugaboo y hazla única.', 'fundas bugaboo camaleon, fundas bugaboo, fundas para bugaboo camaleon, fundas bugaboo personalizadas, fundas sillas bugaboo, funda bugaboo camaleon, colchoneta bugaboo, colchoneta bugaboo camaleon', 'Fundas Bugaboo modernas y diferentes. Cambia el estilo de tu Bugaboo Camaleon, Buffalo, donkey, bee, Frog... y diferencia tu silla! Confeccinadas a medida.'),
(168, 1, 6, 'Capazo Bugaboo', 'Personaliza tu silla Bugaboo con originales y unicos estampados. Haz que tu bugaboo sea el captador de todas las miradas!', 'capazo-bugaboo', 'Capazo Bugaboo, hazlo único con nuestras fundas modernas - Teoyleo', 'sacos para capazo, capazo bugaboo camaleon, sacos capazo bugaboo, cubre capazo, cubrepies camaleon, cubrepies bugaboo, cubrepies donkey, cubre capazo donkey, cubre capazo camaleon, funda capazo, accesorios bugaboo, cubre coches bugaboo, cubre cuco bugaboo', 'Tu capazo Bugaboo con originales estampados. Personaliza tu silla bugaboo para que sea el captador de todas las miradas! Exclusivos y modernos diseños.'),
(169, 1, 6, 'Accesorios Bugaboo', 'Accesorios unicos y originales para dar un toque chic a tu silla Bugaboo.', 'accesorios-bugaboo', 'Accesorios Bugaboo para tu silla Bugaboo, Bee y Donkey - Teoyleo', 'cubre cinturones personalizados, accesorios bugaboo, accesorios camaleon, accesorios donkey, accesorios bee, funda reposabrazos Bugaboo, funda manillar Bugaboo, accesorios bugaboo camaleon online, bugaboo camaleon accesorios, accesorios originales bebes', 'Accesorios modernos y unicos para personalizar tu silla Bugaboo Camaleon, Donkey y Bee. Funda para el manillar, cubre cinturones personalizados, reposabrazos'),
(170, 1, 6, 'Sets Bugaboo', 'Cambia por completo el estilo de tu silla Bugaboo. Fabricamos para ti con tu estampado favorito capotas, sacos, fundas, cubrepies y muchos otros accesorios. Encuentra aqui tu set de capota, saco, funda, colchoneta y haz unico tu Bugaboo Camaleon, Frog, Donkey o Bee.', 'sets-bugaboo', 'Sets Bugaboo. Conjuntos para cambiar el look de tu Bugaboo - Teoyleo', 'accesorios Bugaboo, fundas Bugaboo Camaleon, fundas Bugaboo Donkey, capota Bugaboo Camaleon, capota Bugaboo Bee, capota Bugaboo Donkey, fundsa Donkey, capazo Bugaboo Camaleon, cubrepies Bugaboo, sacos capazo Bugaboo, fundas Bugaboo personalizadas', 'Cambia por completo el estilo de tu silla Bugaboo. Fabricamos para ti con tu estampado favorito capotas, sacos, fundas, cubrepies y muchos otros accesorios'),
(171, 1, 6, 'STOKKE', 'Personaliza tu silla Stokke con los complementos mas divertidos, elige tu estilo favorito!', 'stokke', 'Stokke, complementos para que tu silla tenga un look moderno.', 'silla Stokke, complementos silla Stokke, complementos Stokke, accesorios silla Stokke, accesorios Stokke, accesorios carro Stokke, sabana stokke, cubre pies stokke, cubre capazo stokke, capota stokke, funda sabana stokke, saco capazo stokke, saco stokke', 'Complementos para silla Stokke. Puedes elegir tu estampado favorito y personalizar al funda de la sabana, la capota, el cubre capazo. Tambien hacemos sacos.'),
(172, 1, 6, 'Capotas Stokke', 'Personaliza tu silla Stokke Xplory. Elige el estampado o dibujo que mas te guste y Teoyleo confecciona la capota para que tu Stokke sea único y original.', 'capotas-stokke', 'Capota personalizada para tu silla Stokke, confeccionada para ti', 'capota Stokke, capota Xplory, capota personalizable, capota confeccionada a medida, capota customizable Stokke', 'Personaliza tu silla Stokke Xplory. Elige el estampado o dibujo que mas te guste y Teoyleo confecciona la capota para que tu Stokke sea único y original.'),
(173, 1, 6, 'Capazo Stokke', 'Dale un toque chic a tu capazo Stokke con nuestras fundas de colchon y los cubre capazos, personalizados con tu estampado favorito.', 'capazo-stokke-personalizalo', 'Accesorios para capazo Stokke, atrevete a personalizar tu Stokke!', 'capazo, capazo Stokke, funda sabana Stokke', 'Atrevete a que tu capazo Stokke sea unico y original! Te proponemos una personalizacion a tu gusto. Fundas y cubre capazos con tu estampado favorito.'),
(174, 1, 6, 'LITTLEPHANT', 'Bolsos elegantes y exclusivos, diseño nordico y calidad única.\r\nLa joya de la corona, si necesitas llevar  tus cosas y las de tus hijos, ir al trabajo y además te gusta ir a la moda, te van a encantar los bolsos de littlephant!\r\nBolsos de bebé para madres con estilo.', 'littlephant', 'Littlephant - Bolsos de bebé para madres con estilo.', 'littlephant, bolso littlephant, bolso bebé littlephant, bolso bebe moderno, bolsos bebe exclusivo, bolso bebe de diseño, bolso maternal, bolso manternal littlephant, bolsa cambiador littlephant, cambiador bebé, regalo bolso moderno madre, bolso embarazada', 'Bolsos Littlephant, para guardar todo lo que necesite tu bebé. Diseños exclusivos y modernos, para bolsos de bebé que parecen bolsos de mujer. Envio gratis.'),
(175, 1, 6, 'ARRULLOS BEBE', 'Arrullos para bebes con estampados únicos y diferentes, para que puedas hacer un regalo original y moderno a cualquier nuevo padre. Muselinas, toallas, capas, toquillas, mantintas: arrulla a tu bebé con una explosion de colores y vitalidad.', 'arrullos-bebe', 'Arrullos para bebes con estampados modernos, elige tu favorito!', 'arrullo, arrullo bebe, toquilla, toquilla bebe, envolver al bebe, arrullo recien nacido, regalo original bebe', 'Arrullos para bebes con estampados modernos y unicos, elige tu favorito y abriga a tu bebé con estilo. Sets de arrullos y muselinas diferentes, regala originalidad.'),
(176, 1, 6, 'Bolsos bebé Teoyleo', 'Bolsos para mama y para el carrito del bebe modernos y originales. Tu estilo lo eliges tu, dinos tu estampado favorito y cambia el look de tu silla de paseo.', 'bolsos-maternales-teoyleo', 'Bolsos maternales de originales diseños y estampados modernos.', 'bolsos maternales, bolsos carrito bebe, bolsos para carrito de bebe, bolso cambiador, bolso carro bebe, bolso cochecito bebe, bolso silla bebe, bolso para bebes modernos, bolso cambiador bebe, bolsos para bugaboo, bolsos para stokke, bolsos para jane', 'Bolsos de bebé modernos. Tamaño ideal, ordena todo lo que tu bebe necesita. Elige tu estampado preferido y define tu estilo. Bolsos maternales originales!'),
(177, 1, 6, 'Cambiadores bebé Teoyleo', 'La solución a los pañales. Un cambiador que cabe en tú bolso. Tamaño justo para cambiar al bebé en cualquier superficie y poder guardar un par de pañales y las toallitas.', 'cambiadores-bebe-teoyleo', 'Bolsitos cambiadores, de diseños originales y muy útiles - Teoyleo', 'bolsos maternales, bolsos carrito bebe, bolsos para carrito de bebe, bolso cambiador, bolso carro bebe, bolso cochecito bebe, bolso silla bebe, bolso para bebes modernos, bolso cambiador bebe, bolsos para bugaboo, bolsos para stokke, bolsos para jane', 'Cambiador con tu estampado favorito. Elige el color y el estampado que mas te guste y personaliza tu cambiador a tu gusto. Un regalo original y practico!'),
(178, 1, 6, 'COLCHONETAS SILLA BEBE', 'Dale un aire nuevo a tu carro con estas colchonetas para silla de paseo personalizables. Son colchonetas universales que se ajustan a cualquier carro de bebé.', 'colchonetas-bebe', 'Colchoneta silla paseo: personaliza tu colchoneta a tu gusto.', 'colchonetas para silla de paseo, colchoneta silla paseo, colchoneta bugaboo, colchoneta stokke, colchoneta bugaboo camaleon, colchoneta silla, colchoneta bebe, colchoneta carro, colchoneta bee, colchoneta universal, fundas bugaboo, fundas bugaboo camaleon', 'Cambia el look de tu silla con una colchoneta moderna y comoda. Sirven para cualquier tipo de carro, ya que son universales. Elige tu estampado favorito.'),
(179, 1, 6, 'Bodies y pijamas bebés ', 'Bodys, bodysuits y pijamas originales para bebes molones.', 'bodies-originales-bebes', 'Ropa bebe original. Bodys y pijamas modernos para bebes molones.', 'ropa bebe original, ropa original para bebes, ropa alternativa bebe, conjuntos de ropa de bebe, bodys bebe modernos, pijamas bebes modernos, bodies bebe modernos, bodies para bebes divertidos, ropa moderna para bebes', 'Bodys originales para bebes molones. Bodysuits y pijamas para que tu bebe luzca un look moderno y lleno de color. Customiza el body de tu bebé y hazlo único.'),
(180, 1, 6, 'Vestidos bebé originales', 'Vestidos para bebes de 0 a 2 años originales y modernos.', 'vestidos-bebe-originales', 'Vestidos para bebes de 0 a 2 años originales y modernos.', 'vestido bebe, pelele bebe, ropa bebe, ropa original bebe, ropa moderna bebe, vestidos modernos bebe, vestidos modernos niña, vestidos modernos para bebes, vestidos originales bebe, regalos originales para un bebe recien nacido, vestidos alternativos bebe', 'Vestidos para bebes con diseños modernos y divertidos. Viste a tu bebe con el mismo estilo que elegirias para ti. Ropa para bebes originales y molones.'),
(181, 1, 6, 'Buzos y chaquetas bebé', 'Buzos, overall y chaquetas para abrigar a tu bebé del frio.', 'buzos-y-chaquetas-bebe', 'Buzo con diseño original para abrigar a bebes molones', 'buzo, overall, buzo bebe, overall bebe, abrigo bebe, chaqueta bebe, abrigar bebe', 'Overall o buzo con diseños originales y modernos para abrigar a tu bebe. Materiales suaves y abrigados para que tu bebe este siempre bien cuidado.'),
(182, 1, 6, 'sin categoria', NULL, 'sin-categoria', NULL, NULL, NULL),
(183, 1, 6, 'Juguetes bebé', 'Juguetes para bebés, perfectos para regalar y que los mas pequeños disfruten. Pensados para ellos, originales y prácticos.', 'juguetes-bebe', 'Juguetes para bebes de 0 a 2 años - Teoyleo', 'juguetes originales para bebes, tienda de regalos,tienda de juguetes, tienda de bebes, puericultura moderna, regalos originales para recien nacidos, regalos para niños y embarazadas, regalos para papas y mamas', 'Juguetes originales para que tu bebe se divierta descubriendo sus sentidos. Regalos y juguetes utiles y practicos para cualquier bebé de 0 a 2 años.'),
(184, 1, 6, 'Portachupetes', 'Para tener agarrado el mordedor, su juguete favorito o su chupete y evitar que se pierda.', 'portachupetes', 'Portachupetes, accesorio indispensable para evitar perder el chupete', 'chupete, portachupete, tete, mordedor, portajuguetes', 'Portachupetes, accesorio indispensable para evitar que tu bebé pierda su chupete o cualquier juego que tenga entre las manos mientras lo paseas por la calle.'),
(186, 1, 6, 'PETUNIA PICKLE BOTTOM', 'Petunia Pickle Bottom es una prestigiosa firma estadounidense de bolsos de maternidad para el bebé, donde la calidad y el estilo son su sello de identidad.', 'petunia-pickle-bottom', 'Petunia Pickle Bottom, bolsos elegantes para madres modernas.', 'petunia pickle bottom, bolso ppb, bolso bebé, bolso carrro, bolso bebe ppb, maleta hospital, maleta hospital parto, parto, bebe, regalo original, bolso bebe hospital, cambiador bebe, bolso bebé moderno, bolso carro moderno, bolso silla moderno', 'Los bolsos de bebé Petunia Pickle Bottom son bolsos elegantes y modernos para madres que desean luciar un bolso de carro como si fuera su bolso diario.'),
(188, 1, 6, 'Saco grupo 0 maxi cosi', 'Sacos para la silla grupo 0 o maxi cosi', 'saco-grupo-0-maxi-cosi', 'Sacos grupo 0, saco maxi cosi', 'saco maxicosi, saco maxi cosi, saco grupo 0, saco grupo0, saco bebe maxicosi, saco maxicosi stokke, saco maxicosi bugaboo, saco maxicosi jane, saco universal maxicosi, saco universal grupo 0, saco universal bebé', 'Sacos grupo 0 y sacos maxi cosi para renovar el look de tu maxi cosi. Abriga a tu bebe en la silla grupo 0 con nuestros originales sacos para maxi cosi.'),
(189, 1, 6, 'Portatoallitas kiwisac', 'Prácticos neceseres para llevar los paquetes de toallitas húmedas, siempre accesibles y sin que manchen el bolso.\r\nAdemás con el divertido estilo de Kiwisac!', 'portatoallitas-kiwisac', 'Portatoallitas kiwisac, neceser plastificado para llevar toallitas', 'toallitas bebé, accesorios originales bebé', 'Portatollitas de bebé de kiwisac, neceser plastificado perfecto para llevar las toallitas humedas del bebé. Con la abertura para sacarlas u que no se sequen.'),
(190, 1, 6, 'Sacos de dormir', 'Preciosos sacos abrigados para que el bebé no se destape en la cama o en la hamaquita.\r\nLo puedes llevar también en el capazo.\r\nSiempre abrigado y a la moda!', 'sacos-de-dormir', 'Sacos de cuna para bebé,  calentitos y con libertad de movimiento', 'sacos dormir bebé, saco cuna bebé', 'Cómodos sacos de cuna para bebé de tirantes, el bebé estará siempre abrigado y con libertad de movimientos. Lo puedes usar en la hamaca y en el capazo.'),
(191, 1, 6, 'Portadocumentos bebe Mybags', 'Portadocumentos bebé, para guardar de forma ordenada todos los documentos de tu bebé.', 'portadocumentos-bebe-mybags', 'Portadocumentos bebe modernos', 'portadocumentos, Mybags', 'Portadocumentos Mybags con modernos estampados, para guardar toda la documentacion de tu bebé. Un regalo original y práctico para mantener todo en orden.'),
(192, 1, 6, 'Toallitas microfibra Mybags', 'Toallitas de microfibra de Mybags, un complemento perfecto para el cambiador o neceser.', 'toallitas-microfibra-mybags', 'Toalla de microfibra de modernos estampados para niños y bebes.', 'toalla bebe', 'Toalla de microfibra compacta y de rápida absorción. Para escapes inoportunos. Para secar las babitas de los primeros dientes del bebé. Varios estampados.');
INSERT INTO `ps_category_lang` (`id_category`, `id_shop`, `id_lang`, `name`, `description`, `link_rewrite`, `meta_title`, `meta_keywords`, `meta_description`) VALUES
(193, 1, 6, 'FUNDAS HAMACAS BABYBJORN', 'Fundas para hamacas de bebé originales y modernas.\r\nFundas para personalizar tu hamaca Babybjorn.', 'fundas-hamacas-bebe', 'Fundas para hamacas de bebe Babybjorn con tu tela favorita', 'hamaca, hamaca babybjorn, babybjorn, funda babybjorn', 'Fundas para hamacas de bebe Babybjorn. Fundas modernas y originales para personalizar tu hamaca Babybjorn. Elige tu tela favorita y renueva tu hamaca. '),
(194, 1, 6, 'JANE & CONCORD', 'Personaliza tu silla Jane y Concord con nuestras capotas, fundas, colchonetas, ect. Productos especialmente diseñados para las sillas Jane y Concord.', 'sila-jane-concord', 'Jane y Concord, personaliza tu silla.', 'jane, silla jane, silla jane rider, silla concord neo', 'Capotas y fundas para las sillas Jane y Concord. Elige tu estampado favorito y cambia el look de tu silla Jane y Concord. Accesorios para silla Jane y Concord.'),
(195, 1, 6, 'Colchonetas y fundas Stokke', 'Colchonetas especialmente diseñadas para tu silla Stokke.', 'colchonetas-stokke', 'Stokke, colchonetas y fundas para tu silla Stokke Xplory.', 'stokke, colchoneta, funda Stokke', 'Colchonetas y fundas Stokke Xplory, elige tu estampado favorito: topos, calaveras, matrioskas, heavies o dulces, tu eliges tu estilo. Haz tu silla única!'),
(196, 1, 6, 'Sets Stokke Xplory', 'Cambia por completo el estilo de tu silla Stokke Xplory. Confeccionamos para ti con tu estampado favorito capotas, sacos, fundas, cubrepies y muchos otros accesorios. Encuentra aqui tu set de capota, saco, funda, colchoneta y haz unico tu Stokke Xplory', 'conjuntos-stokke-xplory', 'Sets Stokke Xplory para cambiar el look de tu silla Stokke Xplory', 'stokke, stokke xplory', 'Capotas, fundas, sabanas, cubrepies, sacos... todo lo que tu silla Stokke Xplory necesita para vestirla y cambiar el look de tu silla Stokke Xplory.'),
(197, 1, 6, 'Maletas Kiwisac', 'Bonitas maletas con estampados modernos e innovadores. \r\nPara llevar toda la ropa de tu bebé.', 'maletas-kiwisac', 'Maletas bebé Kiwisac con estampados modernos.', 'maleta, kiwisac, estampado moderno, bebé', 'Maletas fabricadas en resistente nylon. Estampados modernos e innovadores de Kiwisac. Lleva toda la ropa de tu bebé y la tuya cuando salgais de viaje.'),
(198, 1, 6, 'BABYMEL', 'Bolsos modernos y elegantes Babymel', 'babymel', 'Bolsos para bebé Babymel', 'Babymel, bolso carro, bolso bebé', 'Bolsos modernos y elegantes de la marca Babymel. Combinan los colores para que lucan genial en tu carrito de bebé. Bolsos maternales grandes y prácticos.'),
(200, 1, 6, 'MACLAREN', 'Accesorios Maclaren, personaliza tu silla Maclaren con complemento únicos.', 'maclaren', 'Accesorios Maclaren para personalizar tu silla.', NULL, 'Accesorios Maclaren. Dale un look diferente a tu silla Maclaren con nuestros complementos, elige tu estampado favorito y personaliza tu capota, funda...'),
(201, 1, 6, 'Set regalo bebe', 'Regalos para bebes, originales y únicos!', 'set-regalo-bebe', 'Set regalo bebe - canastillas originales para regalar', NULL, 'Regalos para bebes originales. Ideas para que tu regalo sea divertido y unico. Sets para bebes, para celebrar con un regalo muy especial el nacimiento.'),
(202, 1, 6, 'Sacos Jane', 'Sacos Jane, cambia el look de tu silla de paseo Jane con nuestros sacos personalizados', 'sacos-jane', 'Sacos Jane: sacos para sillas Jane unicos y diferentes', NULL, 'Sacos Jane, sacos para sillas de paseo Jane unicos y diferentes, tu marcas tu estilo, nosotros hacemos el saco para que tu bebe este calentito y comodo.'),
(203, 1, 6, 'MAXI COSI - GRUPO 0', 'Accesorios Maxi Cosi para hacer tu silla única y diferente. En esta sección podrás encontrar fundas Maxi-Cosi, sacos para Maxicosi, capota Maxi Cosi, y muchos otros complementos para personalizar tu silla grupo 0 con nuestros estampados.', 'maxi-cosi', 'Maxi cosi: sacos, fundas, capotas...Todo para tu Maxi cosi grupo 0', NULL, 'Maxi cosi, sacos, fundas, capotas..., todos los accesorios para tu Maxi cosi. Para que tu silla Maxicosi luzca diferente y unica con tu estampado favorito.'),
(204, 1, 6, 'Saco Maxi Cosi', 'Saco Maxi Cosi para que tu bebé vaya calentito en su sillita Maxi Cosi o grupo 0. Elige tu estampado favorito y personaliza tu saco para Maxi Cosi para que sea único y especial.', 'saco-maxi-cosi', 'Saco Maxi Cosi. Saco para Maxi Cosi con tu estampado favorito', 'saco maxi cosi, sacos maxi cosi, sacos para maxi cosi, saco maxi cosi cabriofix', 'Saco Maxi Cosi diferente. Tu eliges tu tela favorita, tenemos diferentes estampados: calaveras, geishas, superheroes... Tu Maxi Cosi con un estilo único!'),
(205, 1, 6, 'Fundas Maxi Cosi', 'Fundas Maxi cosi con tu estampado favorito. Fundas para proteger tu maxi cosi, o simplemente para mantenerlo limpio mas fácilmente. Fundas para Maxi Cosi adaptables para modelos como CabrioFix, Jane, Bebé Confort, Izi Sleep, Go...', 'fundas-maxi-cosi', 'Fundas Maxi Cosi con tu tela favorita: calaveras, superheroes...', NULL, 'Fundas para Maxi Cosi, haz que la silla de tu bebé luzca siempre limpia y con un look moderno y desenfadado. Estampados diferentes, tejidos 100% algodon.'),
(206, 1, 6, 'Capota Maxi Cosi', 'Capotas para Maxi Cosi originales y únicas. Elige tu estampado favorito para que tu maxi cosi luzca moderno y diferente. Capotas para Maxi Cosi Cabriofix, Bugaboo, Jane, Bebe confort, Stokke Izi Sleep... elige tu modelo de maxi cosi o grupo 0.', 'capota-maxi-cosi', 'Capota Maxi Cosi - elige tu tela favorita: calaveras, superheroes..', 'maxi cosi, capota maxi cosi, ', 'Capota para Maxi Cosi personalizada. Elige tu estampado favorito de nuestro catalogo y nosotros confeccionamos la capota para que se adapte a tu maxi cosi.'),
(207, 1, 6, 'Cubre Maxi Cosi', 'Cubre Maxi Cosi para cubrir tu silla maxi cosi o grupo 0.\r\nElige tu estampado favorito y renueva tu silla Maxi Cosi con nuestros cobertores.', 'cubre-maxi-cosi', 'Cubre Maxi Cosi. Elige tu tela favorita: calaveras, topos, rayas...', NULL, 'Cubre Maxi Cosi para cubrir tu silla Maxicosi Cabriofix, Bugaboo, Bebe confort... Cobertor para proteger del frio a tu bebé. Elige tu estampado favorito.'),
(208, 1, 6, 'BORSINO BABY', 'Accesorios para tu silla Borsino Baby Anne. Cambia el aspecto de tu silla Borsino con nuestras capotas, fundas, colchonetas, sacos, cubre pies... Elige tu estampado favorito y haz que tu carrito Borsino Baby Anne luzca diferente!', 'borsino-baby', 'Borsino Baby, accesorios para que tu carrito Anne luzca diferente.', NULL, 'Textiles ajustados al carrito Anne de Borsino Baby. Elige tu tela favorita, chevron, calaveras, flores... y haz que tu silla Anne sea diferente y unica.'),
