(211, 1, 1, 'Baby gifts', '', 'baby-gifts', 'Baby gifts & ideas. Personalized lovely newborn presents | Teoyleo', '', 'If you want to make THE perfect present for a baby or a new mum, have a look to our unique ideas and original sugestions for baby gifts and lovely presents'),
(211, 1, 3, 'Regalos para bebés', '<p>Los regalos para bebés mas bonitos y originales los podrás encontrar en nuestra tienda de Teoyleo.</p>\n<p>Somos especialistas en hacer único cualquier detalle para ese recien nacido que viene en camino.</p>\n<p>Nuestros clientes son nuestra mejor publicidad, les encantan nuestros regalos para bebés. Puedes comprobarlo en nuestro instagram, facebook o en las reseñas de google.</p>', 'regalos-para-bebes', 'Regalos bonitos para bebes recien nacidos', '', 'Sorprende con nuestras ideas de regalos para bebes y recien nacidos. Propuestas originales para acertar en tus regalos para embarazadas o mamas recientes.'),
(211, 1, 4, 'Des cadeaux pour bébé', '', 'des-cadeaux-pour-bebe', 'Des Cadeaux unique pour la naissance et des idée idéale pour bébé', '', ''),
(212, 1, 1, 'Custom your stroller', '', 'custom-your-stroller', 'Handmade Canopies, footmuffs, seat liners & accesories personalised', '', 'Get a brand new look for your pushchair with our custom products, diaper bags, seat liners, footmuff, and handmade accesories, choose your favorite print.'),
(212, 1, 3, 'Fundas carritos de bebé', '<p><span><span class=\"HALYaf KKjvXb\"><span><span class=\"zRhise\"><span title=\"fundas para carritos de bebe personalizadas\">Fundas para carritos de bebe personalizadas. Hacer fundas para carritos de bebé es nuestra pasión. Nos diferencia la originalidad y los diseños únicos como tu bebé.<br /></span></span></span></span></span></p>\n<p>Las fundas de Teoyleo nos son precisamente sencillas, sino que van un paso mas alla de lo convencional. Por eso es muy fácil hacer que tu carrito sea diferente y original y se distinga del resto.</p>', 'fundas-carritos-de-bebe', 'Fundas, sacos, bolsos y capotas para carritos de bebé', '', 'Bolsos personalizados para carritos de bebe. Cambia el look de tu silla o carrito: fundas para sillas, capotas, sacos y colchonetas con tu tela favorita!'),
(212, 1, 4, 'Personnalisser poussette', '', 'personnalisser-poussette', 'Capotes, housse ,chanceliere et accessoires pour les Poussettes ', '', 'Personnalisez votre poussette grâce à nos suggestions: capotes, housse pour poussette, chanceliere, sac á langer, et accessoires pour les Poussettes.'),
