(225, 1, 1, 'Baby nest', '<p>Baby nest is a super cute little crib, thought to make parents and babies life easier.</p>\n<p>Perfect to have your little one always near you, co-sleep and traveling</p>', 'baby-nest', 'Baby nest is a super cute little crib, soft snuggle baby nest', '', 'Baby nest is a super cute little crib, thought to make parents and babies life easier.\r\n\r\nPerfect to have your little one always near you, co-sleep and traveling'),
(217, 1, 1, 'JANE MATRIX - JANE TRANSPORTER', '<p>Give a brand new look to your Jane Matrix or Jane Transporter pushchair with our accesories.</p>\n<p>Canopies, carry cot covers, sheets for your Transporter or Matrix with your favorite print.</p>\n<p>Check out our cazy toes and footmuffs availables for winter and warm weather.</p>\n<p>Choose your style and renew your Matrix with your favorite fabric.</p>', 'jane-matrix-accesories', 'Give a brand new look to your Jane Matrix or Jane Transporter pushchair', '', 'Give a brand new look to your Jane Matrix or Jane Transporter pushchair with our accesories.\r\nCanopies, carry cot covers,with your favorite print.'),
(217, 1, 3, 'JANE MATRIX ', '<h2>Accesorios textiles para vestir el capazo Jane Matrix!</h2>', 'jane-matrix', 'Fundas para Jane MATRIX - confeccionadas a medida', '', 'Fundas Jane Matrix, renueva su look con nuestras fundas únicas y diferentes. Sabanas, capotas, cubre pies, lisas o estampadas. Todo a medida del Jane Matrix.'),
