(290, 1, 3, 'FUNDAS NIU VENTT TWIN GEMELAR', '<h2>Fundas para Niu Ventt Twin - accesorios para tu carrito gemelar únicos</h2>', 'fundas-niu-ventt-twin-gemelar', 'Fundas carrito gemelar Niu Ventt Twin', '', 'Niu Ventt twin accesorios a medida únicos. Cosemos sacos y colchonetas para el carrito gemelar Niu Ventt twin. Fundas diferentes.'),
(280, 1, 1, 'Sacos gemelares', '', 'sacos-gemelares', '', '', ''),
(217, 1, 4, 'JANE MATRIX - JANE TRANSPORTER', '<p>Donner un style différent a votre Jane Matrix et Jane Transporter poussette avec notre accesories personnalisées. Capotes, nacelles couverture..</p>', 'jane-matrix-accesorires', 'Donner un style différent a votre Jane Matrix et Jane Transporter ', '', 'Donner un style différent a votre Jane Matrix et Jane Transporter poussette avec notre accesories personnalisées. Capotes, nacelles couverture..'),
(218, 1, 1, 'JANE RIDER - TRIDER - EPIC', '<p>Unique and gorgeous accesories for your Jane rider, jane Epic or Jane Trider.</p>\n<p>Cotton seat liners that will change the look of your pushchair completely.</p>\n<p>Renew your Jane with our canopies that fit perfectly!</p>\n<p>Get a look to our summer or winter footmuffs that look great on your Jane.</p>\n<p>You just have to choose your favorite print from our cotton fabric catalogue.</p>\n<p>They are made by order just for you!</p>', 'jane-rider-trider-epic', 'Unique and gorgeous accesories for your Jane rider, jane Epic or Jane Trider.', '', 'Unique and gorgeous accesories for your Jane rider, jane Epic or Jane Trider.\r\nRenew your Jane with our canopies ans seat liners that fit perfectly!'),
(218, 1, 3, 'JANE RIDER', '<h2>Accesorios únicos y diferentes para hacer única tu silla Jane Rider!</h2>', 'jane-rider', 'Capotas y sacos para Jane Rider - diseños exclusivos', '', 'Jane Rider, Epic... - accesorios unicos. Renueva el aspecto de tu silla Jane Rider con nuestras capotas y fundas. Hecho a medida con tu tela favorita.'),
(218, 1, 4, 'JANE RIDER - TRIDER - EPIC', '<p>Si vous voulez vous donner un style différent a votre Jane rider, jane epic ou jane trider, personnalisez votre poussette grâce à nos suggestions. </p>\n<p>Capotes, housse, nacelles, elles s\'y ajustent parfaitement, choisissez le tissu qui vous plaît le plus et mettez en valeur votre poussette Jane de manière originale.  </p>', 'jane-rider-fundas-y-capotas', 'Accesoires pour poussette Jane rider, jane epic et jane trider', '', 'Si vous voulez vous donner un style différent a votre Jane rider, jane epic ou jane trider, personnalisez votre poussette grâce à nos suggestions.  '),
(219, 1, 1, 'JANE MUUM', '<div class=\"cat_desc\">\n<div id=\"category_description_full\">\n<p>Unique and gorgeous accesories for your Jane Muum</p>\n<p>Cotton seat liners that will change the look of your pushchair completely.</p>\n<p>Renew your Jane Muum with our canopies that fit perfectly!</p>\n<p>Get a look to our summer or winter footmuffs that look great on your Jane Muum</p>\n<p>You just have to choose your favorite print from our cotton fabric catalogue.</p>\n<p>They are made by order just for you!</p>\n</div>\n</div>', 'jane-muum', 'Accesories for Jane Muum, Renew your Jane Muum with our canopies,covers', '', 'Unique and gorgeous accesories for your Jane Muum\r\n\r\nCotton seat liners, canopies, covers.. that will change the look of your pushchair completely.\r\n'),
(219, 1, 3, 'FUNDAS JANE MUUM', '<h2>Accesorios Jane Muum: capotas, sacos y colchonetas para renovar el aspecto de tu carrito</h2>', 'fundas-jane-muum', 'Capotas y sacos para Jane Muum - diseños exclusivos', '', 'Accesorios carro Jane Muum: nos dedicamos a coser fundas, colchonetas, capotas y sacos para la silla Jane Muum. Haz única tu silla Jane Muum.'),
(290, 1, 4, 'FUNDAS NIU VENTT TWIN GEMELAR', '', 'fundas-niu-ventt-twin-gemelar', '', '', ''),
(219, 1, 4, 'JANE MUUM ', '<div class=\"cat_desc\">\n<div id=\"category_description_full\">\n<p>Si vous voulez vous donner un style différent a votre Jane Muum, personnalisez votre poussette grâce à nos suggestions. </p>\n<p>Capotes, housse, nacelles, elles s\'y ajustent parfaitement a la poussette jane muum, choisissez le tissu qui vous plaît le plus et mettez en valeur votre poussette Jane Muum de manière originale.  </p>\n</div>\n</div>', 'jane-muum', 'Accesoires pour poussette jane muum, capotes, housse..fait a la main', '', 'Si vous voulez vous donner un style différent a votre Jane Muum, personnalisez votre poussette grâce à nos suggestions. '),
(220, 1, 1, 'CONCORD', '<div class=\"cat_desc\">\n<div id=\"category_description_full\">\n<p>Unique and gorgeous accesories for your Concord Neo</p>\n<p>Cotton seat liners that will change the look of your pushchair completely.</p>\n<p>Renew your Concord with our canopies that fit perfectly!</p>\n<p>Get a look to our summer or winter footmuffs that look great on your Concord</p>\n<p>You just have to choose your favorite print from our cotton fabric catalogue.</p>\n<p>They are made by order just for you!</p>\n</div>\n</div>', 'concord', 'Unique and gorgeous accesories for your Concord Neo.', '', 'Unique and gorgeous accesories for your Concord Neo.\r\nRenew your Concord with our canopies, seat liners, footmuffs...that fit perfectly!'),
(220, 1, 3, 'FUNDAS CONCORD', '<h2>Fundas Concord - confeccionamos a medida los accesorios que harán único tu cochecito.</h2>', 'fundas-concord', ' Concord Neo - fundas y sacos para tu cochecito', '', 'Confeccionamos capotas, fundas, protectores, sacos, ect, para la silla y capazo de bebe Concord Neo. Puedes elegir tu tela favorita de nuestro catalogo. '),
(220, 1, 4, 'CONCORD', '<div class=\"cat_desc\">\n<div id=\"category_description_full\">\n<p>Si vous voulez vous donner un style différent a votre Concord Neo , personnalisez votre poussette grâce à nos suggestions. </p>\n<p>Capotes, housse, nacelles, elles s\'y ajustent parfaitement, choisissez le tissu qui vous plaît le plus et mettez en valeur votre poussette Concord de manière originale.  </p>\n</div>\n</div>', 'concord', ' personnalisez votre poussette concord neo grâce à nos suggestions. ', '', 'Capotes, housse, nacelles, pour concord neo, elles s\'y ajustent parfaitement, choisissez le tissu qui vous plaît le plus et mettez en valeur votre poussette Concord de manière originale.  '),
(225, 1, 3, 'NIDO BEBE', '<h2>Nidos para bebés recién nacidos - un regalo con mucho amor!</h2>', 'cuna-nido-bebe', 'Nido bebé - cojin de colecho bonito', '', 'Nido bebé, el cojin de colecho prefecto! Diseñado para que tu bebe descanse siempre cerca de ti. Suave tela 100% algodón. Un regalo original y practico.'),
(293, 1, 1, 'EASYWALKER ACCESORIOS', '', 'easywalker-accesorios', '', '', ''),
(221, 1, 1, 'MAXICOSI CABRIOFIX', '<p>Accesories for your Maxi cosi Cabrio Fix, if you wish to give a new look to your cabrio fix, or just renew it, get a look at all our accesories, canopies, cosytoes, footmuffs, liners...<br />And many others accesories for your maxi cosi cabrio fix pushchair</p>', 'maxicosi-cabriofix', 'Accesories for your Maxi cosi Cabrio Fix', '', 'Accesories for your Maxi cosi Cabrio Fix, if you wish to give a new look to your cabrio fix,get a look at  our canopies, cosytoes, footmuffs, liners.'),
(221, 1, 3, 'MAXICOSI CABRIOFIX', '<h2>Fundas para Maxi-cosi Cabriofix diferentes y únicas.</h2>', 'maxicosi-cabriofix-fundas', 'Fundas y capotas para el maxi cosi Cabriofix - Teoyleo', '', 'Renueva el aspecto de tu silla de coche maxi cosi Cabriofix con fundas, capotas, cubrepies o sacos modernos y diferentes. '),
(287, 1, 1, 'Saco Inglesina', '', 'saco-inglesina', '', '', ''),
(287, 1, 3, 'Saco Inglesina', '<h2>Fundas diseñadas para utilizar sobre tu silla Inglesina.</h2>', 'saco-inglesina', 'Sacos Inglesina - confeccionados a medida', '', 'Sacos confeccionados a medida para la silla Inglesina. Los cosemos con la tela que mas te guste de nuestro catálogo. Escapa de la monotonia con Teoyleo!'),
(221, 1, 4, 'MAXICOSI CABRIOFIX', '<p>Accessoires pour maxi cosy, CABRIO FIX<br />faire ta poussette unique et différente. Dans cette section tu pourras trouver des housses pour Maxi-Cosi cabrio fix, des sacs pour Maxicosi, des capotes pour la siege de auto max cosi, et beaucoup d\'autres compléments pour personnaliser ta siege de auto groupe 0 avec nos tissu de coton imprimés.</p>', 'maxicosi-cabriofix', 'Accessoires pour maxi cosy, CABRIO FIX', '', 'Accessoires pour maxi cosy, CABRIO FIX\r\nDans cette section tu pourras trouver des housses pour Maxi-Cosi cabrio fix, des sacs pour Maxicosi, des capotes'),
(222, 1, 1, 'MAXI COSI STOKKE IZI SLEEP', '<p>Accesories for your Maxi cosi Stokke Izi Sleep, if you wish to give a new look to your Stokke Izi sleep, or just renew it, get a look at all our accesories, canopies, cosytoes, footmuffs, liners...<br />And many others accesories for your maxi cosi stokke IZi Sleep pushchair</p>', 'maxi-cosi-izi-sleep-stokke', 'Accesories for your Maxi cosi Stokke Izi Sleep', '', 'Accesories for your Maxi cosi Stokke Izi Sleep, if you wish to give a new look to your Stokke Izi sleep,get a look at all our, canopies, cosytoes, liners..'),
(222, 1, 3, 'MAXICOSI STOKKE BESAFE', '<p>Accesorios textiles para la silla maxi cosi BeSafe de Stokke</p>', 'maxicosi-stokke-besafe', 'Maxi cosi BeSafe de Stokke ® | Fundas, capotas y sacos ', '', 'Accesorios confeccionados a la medida del maxicosi Izi Sleep de Stokke. Disponemos de capotas, fundas, cubre pies y sacos para abrigar a tu bebé.'),
(222, 1, 4, 'MAXI COSI STOKKE IZI SLEEP', '<p>Accessoires pour maxi cosy, Stokke Izi Sleep<br />faire ta poussette unique et différente. Dans cette section tu pourras trouver des housses pour Stokke Izi Sleep, des sacs pour Maxicosi, des capotes pour la siege de auto max cosi, et beaucoup d\'autres compléments pour personnaliser ta siege de auto groupe 0 avec nos tissu de coton imprimés.</p>', 'maxi-cosi-izi-sleep-stokke', 'Accessoires pour maxi cosy, Stokke Izi Sleep', '', 'Accessoires pour maxi cosy, Stokke Izi Sleep\r\nfaire ta poussette unique et différente avec nostres housses pour Stokke Izi Sleep, des sacs, des capotes...'),
