(223, 1, 3, 'MAXICOSI MATRIX JANE', NULL, 'maxicosi-matrix-jane', 'Maxicosi Matrix Jane - fundas y capotas modernas y unicas | Teoyleo', NULL, 'Matrix maxicosi Jane, fundas, capotas y sacos para personalizar tu matrix de Jane. Se confeccionan a medida con tu tela estampada favorita. Renueva tu Matrix!'),
