(224, 1, 1, 'MAXICOSI - OTHER BRANDS', '<p>Universal accesories for your Maxi cosi , if you wish to give a new look to your maxicosi or just renew it, get a look at all our universal accesories, cosytoes, footmuffs, liners...<br />And many others accesories for your maxi cosi pushchair</p>', 'maxicosi-other-brands', 'MAXICOSI - OTHER BRANDS', '', 'Universal accesories for your Maxi cosi,if you wish to give a new look to your maxicosi,get a look at all our universal accesories, cosytoes, footmuffs, liners.'),
(224, 1, 3, 'MAXI COSI - SACOS', '<p>Sacos maxi cosi</p>\n<p>Sacos para personalizar tu sillita maxi-cosi.</p>\n<p>Todos nuestros productos son confeccionados con tejidos de suave algodón 100%.</p>', 'maxi-cosi-sacos', 'Sacos para maxi cosi ó grupo 0 - para invierno y para verano', '', 'Sacos para grupo 0 maxicosi cochecito de bebé. Los sacos más bonitos y elegantes para tu bebé. Fabricados a medida.'),
(303, 1, 1, 'BOLSOS BUGABOO', '', 'bolsos-bugaboo', '', '', ''),
(224, 1, 4, 'MAXICOSI - DIFFÉRENTES MARQUES', '<p>Des Accessoires Universelles pour maxi cosy<br />faire ta poussette unique et différente. Dans cette section tu pourras trouver des housses, des sacs univeselles pour la siege de auto max cosi, et beaucoup d\'autres compléments pour personnaliser ta siege de auto groupe 0 avec nos tissu de coton imprimés.</p>', 'maxicosi-differentes-marques', 'Des Accessoires Universelles pour maxi cosy', '', 'Des Accessoires Universelles pour maxi cosy. Dans cette section tu pourras trouver des housses, des sacs univeselles pour la siege de auto max cosi'),
(225, 1, 4, 'NId pour Bébé', '<p>Le nid bébé est un petit berceau parfait pour que les nouveau-nés se reposent confortablement<br />Fait a main avec tisu de coton super douce.</p>', 'nid-pour-bebe', 'Le nid bébé est un petit berceau,Fait main avec tisu coton super douce', '', 'Le nid bébé est un petit berceau parfait pour que les nouveau-nés se reposent confortablement\r\nFait a main avec tisu de coton super douce'),
(226, 1, 1, 'Padded seat liner for Bugaboo Cameleon', '<p>Padded seat liner for Bugaboo<br />This padded seat liner, it\'s beautifull and comfortable.<br /><br />Check out our beautifull 100% cotton fabric selection, we´ll make a super comfy cushion for your Bugaboo<br />Handmade in Spain with colorfull cotton fabric.<br />Chose your favorite fabric from our great  selection and we´ll make just for you and your little one!!</p>', 'padded-seat-liner-for-bugaboo-cameleon', 'Padded seat liner for Bugaboo, handmade with cotton fabric', '', 'Padded seat liner for Bugaboo\r\nThis padded seat liner, it\'s beautifull and comfortable.\r\nHandmade in Spain with colorfull cotton fabric.'),
(226, 1, 3, 'COLCHONETAS BUGABOO', '<h2 style=\"text-align:left;\"><strong>Colchoneta silla Bugaboo Camaleon</strong> - lleva a tu bebé fresquito y cómodo.</h2>', 'colchonetas-bugaboo', 'Colchoneta Bugaboo Camaleon - diseños exclusivos Teoyleo', '', 'Colchoneta Bugaboo Camaleon para renovar la estética de tu carrito y ofrecer una superficie mullida y cómoda para tu bebé.'),
(295, 1, 1, 'Bolsa respaldo silla bebé', '', 'bolsa-respaldo-silla-bebe', '', '', ''),
(295, 1, 3, 'Bolsa respaldo silla bebé', '<h2>Práctica bolsa diseñada específicamente para colgarse en la parte posterior de la silla de bebé</h2>', 'bolsa-respaldo-silla-bebe', 'Bolsa respaldo para silla bebé: organiza tus paseos', '', 'Descubre la practicidad de la bolsa de respaldo para silla de bebé. Mantén todos los elementos esenciales de tu bebé al alcance de tu mano.'),
(295, 1, 4, 'Bolsa respaldo silla bebé', '', 'bolsa-respaldo-silla-bebe', '', '', ''),
(296, 1, 1, 'CUBRE CESTO PARA SILLA DE PASEO A MEDIDA', '', 'cubre-cesto-para-silla-de-paseo-a-medida', '', '', ''),
(226, 1, 4, ' Coussin confort Pour Bugaboo Cameleon', '<p>Personalisez votre coussin confort Pour Bugaboo<br /><br />Le coussin est fait a main avec votre tissu de coton favorite de notre catalogue!<br /><br />Une fois fixé sur la poussette le coussin d\'assise reste bien en place et ne bouge pas quand on y dépose le bébé ou quand on l\'en sort.</p>', 'coussin-confort-pour-bugaboo-cameleon', 'Personalisez votre coussin confort Pour Bugaboo', '', 'Personalisez votre coussin confort Pour Bugaboo\r\n\r\nLe coussin est fait a main avec votre tissu de coton favorite de notre catalogue!'),
(227, 1, 1, 'BABY REDUCER', '<p>Baby reducer for car seat, strollers...this soft baby reducer is handmade with your favorite cotton fabric.</p>\n<p>The reducer adds extra comfort to the car seat, bouncers, maxi cosi, strollers.</p>\n<p></p>', 'baby-reducer', 'Baby reducer is handmade with your favorite cotton fabric.', '', 'Baby reducer for car seat, strollers, bouncers..\r\n\r\nThe baby reducer adds extra comfort to the car seat, bouncers, maxi cosi, strollers.\r\n\r\n\r\n'),
(227, 1, 3, 'REDUCTORES Y COLCHONETAS PARA MAXI COSIS', '<h2>Colchoneta maxi cosi verano Cabriofix</h2>', 'reductores-y-colchonetas-para-maxi-cosis', 'Colchoneta maxi cosi verano Cabriofix - Teoyleo', '', 'Colchonetas y reductores maxi cosi para el verano. Para mimar a tu recién nacido. Elige tu estilo favorito y personaliza tu maxicosi.'),
(227, 1, 4, 'REDUCTEUR POUR BÉBÉ', '<p>Reducteur pour bébé, Coussin réducteur pour bébé a été spécialement conçu pour apporter un confort supplémentaire pour votre bébé. Le coussin réducteur s\'adapte facilement sur le siège auto, sur le transat, sur le poussette.. Pratique, le réducteur est fait a main avec votre tisu de coton favorite.</p>', 'reducteur-pour-bebe', 'Réducteur pour bébé a été spécialement conçu pour apporter un confort', '', 'Le coussin réducteur s\'adapte facilement sur le siège auto, sur le transat, sur le poussette.le réducteur est fait a main avec votre tisu de coton favorite.'),
(228, 1, 1, 'Twins diaper bag', '', 'twins-diaper-bag', '', '', ''),
(228, 1, 3, 'Bolso para carro gemelar', '<h2>Bolsos gemelares el doble de bonitos!</h2>', 'bolso-para-carro-gemelar', 'Bolso para carro gemelar - tamaño extra grande', '', 'Bolsos gemelares baratos y con diseños alegres y divertidos. Disponemos de una amplia gama e bolsos para carro gemelar, elige tu estampado favorito. '),
(228, 1, 4, 'Sac à langer pour jumeaux', '', 'sac-a-langer-pour-jumeaux', '', '', ''),
(229, 1, 1, 'UPPABABY', '<p>Custom your Uppa Baby pushchair with our handmade accessories for your stroller.</p>\n<p>Our Uppa Baby pushchair Accessories are as Unique as Your Baby!</p>\n<p>Canopies, footmuffs, full seat liner..what about giving to your Uppababy Stroller a diferent and classy touch?</p>\n<p>If you like to mark style and to differ, give to your baby chair a special look with our products!<br /><br />Unique and gorgeous accesories for your Uppa Baby Stroller!<br /><br />Cotton seat liners that will change the look of your pushchair completely.<br /><br />Renew your Uppababy with our canopies that fit perfectly!<br /><br />Get a look to our summer or winter footmuffs that look great on your Uppababy<br /><br />You just have to choose your favorite print from our cotton fabric catalogue.<br /><br />They are handmade by order just for you!</p>', 'uppababy', ' Uppa Baby pushchair Accessories are as Unique as Your Baby! ', 'upaababy accesories, custom uppababy, canopy, liners', 'Custom your Uppa Baby pushchair with our handmade accessories for your stroller.Unique and gorgeous accesories for your Uppa Baby Stroller!\r\nCanopies, liners..\r\n\r\n'),
(229, 1, 3, 'FUNDAS UPPABABY', '<h2>Uppa Baby - Todo lo que necesitas para hacerlo único.</h2>', 'fundas-uppababy', 'Uppa Baby - fundas y capotas a medida', '', 'Para Uppa Baby Cruz y Uppababy Vista hacemos diferentes accesorios textiles. Cambia el look de tu carrito Uppababy con fundas y capotas estampadas.'),
(229, 1, 4, 'UPPABABY', '<p>Poussette Uppababy accessoires personnalisés fait a a main pour Teoyleo avec ton tissu de coton imprimé favorite<br /><br />Personnalisez votre Uppababy :capotes,housses, chanceliére,tout pour votre poussette Uppababy<br /><br />Si vous voulez vous donner un style différent a votre Uppababy , personnalisez votre poussette grâce à nos suggestions. <br /><br />Capotes, housse, nacelles, elles s\'y ajustent parfaitement, choisissez le tissu qui vous plaît le plus et mettez en valeur votre poussette Uppababy de manière originale.</p>\n<p>Accesoires pour poussette Uppababy. Que dites-vous de marquer la vôtre d\'une petite touche de chic?</p>', 'uppababy', 'Poussette Uppababy accessoires personnalisés fait a a main pour Teoyleo', 'uppababy poussette, uppababyaccesoires', 'Poussette Uppababy accessoires personnalisés fait a a main pour Teoyleo avec tissu de coton imprimé \r\nCapotes, housse, nacelles, elles s\'y ajustent parfaitement'),
(230, 1, 1, 'Footmuffs for stroller disabled for children', '<p><span id=\"result_box\" xml:lang=\"en\" lang=\"en\"><span>Special children need special things and in Teoyleo we know it!</span><br /><br /><span>We make winter bags and covers for the adapted car of your child, with your favorite print from our catalog of fabrics.</span><br /><br /><span>Sacks and cover for wheelchairs for disabled children.</span></span></p>', 'footmuffs-for-stroller-disabled-for-children', 'Footmuffs and covers for cars for disabled children', '', 'Special children need special things, and at Teoyleo we love to color wheelchairs for disabled children. Footmuffs that fall in love!'),
(230, 1, 3, 'Sacos para sillas de ruedas', '<h2>Accesorios para sillas de ruedas: niños especiales necesitan cosas especiales y en Teoyleo lo sabemos!</h2>', 'sacos-para-sillas-de-ruedas', 'Sacos para sillas de ruedas - mantas sillas pediátricas', '', 'Descubre todo lo que cosemos para las sillas de ruedas para niños. Niños especiales necesitan cosas especiales. Sacos para sillas de ruedas a todo color!'),
(292, 1, 3, 'Para guardar los pañales', '<h2>Los accesorios mas bonitos para guardar los pañales y cambiar a tu bebé el pañal</h2>', 'para-guardar-los-panales', 'Accesorios para los pañales de los bebés - Teoyleo', '', 'Cambiadores bebé, estuches, porta pañales, bolsilleros para la cuna... Accesorios únicos para regalar y sorprender con tu estampado favorito.'),
(292, 1, 4, 'Para guardar los pañales', '', 'para-guardar-los-panales', '', '', ''),
(230, 1, 4, 'Sacs de voiture handicapés', '<p><span id=\"result_box\" xml:lang=\"fr\" lang=\"fr\"><span>Les enfants spéciaux ont besoin de choses spéciales et à Teoyleo nous le savons!</span><br /><br /><span>Nous fabriquons des sacs d\'hiver et des housses pour la voiture adaptée de votre enfant, avec votre impression préférée de notre catalogue de tissus.</span><br /><br /><span>Sacs et couvertures pour fauteuils roulants pour enfants handicapés.</span></span></p>', 'sacs-de-voiture-handicapes', '', '', ''),
(231, 1, 1, 'Vanity bags for baby', '<p>Super cute vanity bags, for babies and mums.</p>\n<p>Colorfull and super usefull vanity pouches that all family will use.</p>\n<p>Keep all your baby´s staff always handy with this toiletry bags.</p>', 'vanity-bags-for-baby', 'Super cute vanity bags, for babies and mums.', '', 'Cute vanity bags, for babies and mums.\r\n\r\nColorfull vanity pouches that all family will use.\r\n\r\nKeep all your baby´s staff always handy with this toiletry bags'),
(231, 1, 3, 'Neceser bebé', '<h2><span>Neceseres elegantes y prácticos para organizar los artículos de tu bebé.</span></h2>', 'neceser-bebe', 'Neceser bebé personalizados - comprar neceser bebé online', '', 'Encuentra el neceser bebé hospital ideal en Teoyleo. Diseños prácticos y atractivos para organizar los imprescindibles de tu bebé, perfectos para estancias en hospital y uso diario.'),
(231, 1, 4, 'Trousse de toilette pour bébé', '<p>Trousse de tolitte pour bébé et enfant. Nous vous propose un large choix de trousses de toilette pour maman ou pour bébé, avec jolies motifs</p>', 'trousse-de-toilette-pour-bebe', 'Trousse de toilette pour bébé avec jolies imprimés', '', 'Trousse de tolitte pour bébé et enfant. Nous vous propose un large choix de trousses de toilette pour maman ou pour bébé, avec jolies motifs'),
(232, 1, 1, 'Diaper stacker bag', '<p><span id=\"result_box\" xml:lang=\"en\" lang=\"en\"><span>Keep your baby\'s diapers stored and ordered, ready for use, in these precious bags to hang from the crib.</span><br /><br /><span>Our hanging diaper holders are made with your favorite print from our catalog of fabrics.</span><br /><br /><span>Keep the order, at the same time that you decorate any children\'s space.</span><br /><br /><span>An elegant way to store diapers, and have them always at hand, discreetly and elegantly.</span></span></p>', 'diaper-stacker-bag', 'Diaper stacker bag - choose your favourite pattern', '', 'Keep diapers, use them to keep your baby\'s diapers neat and handy. Our diapers are so beautiful that they decorate any children\'s space.'),
(232, 1, 3, 'Guarda pañales cuna', '<h2>Guarda pañales para colgar</h2>', 'guarda-panales-cuna', 'Guarda pañales moderno - tu eliges tu estilo', '', 'Guarda pañales, usalos para mantener ordenados y a mano los pañales de tu bebe. Nuestros guarda pañales son tan bonitos que decoran cualquier espacio infantil.'),
(232, 1, 4, 'Porte-couches diaper organisateur', '<p><span id=\"result_box\" xml:lang=\"fr\" lang=\"fr\"><span>Gardez les couches de votre bébé stockées et commandées, prêtes à l\'emploi, dans ces sacs précieux à accrocher à la crèche.</span><br /><br /><span>Nos porte-couches suspendus sont fabriqués avec votre imprimé préféré de notre catalogue de tissus.</span><br /><br /><span>Nos couches, en plus de maintenir l\'ordre, sont si belles que vous pouvez décorer l\'espace des enfants.</span><br /><br /><span>Une manière élégante de stocker des couches, et de les avoir toujours sous la main, discrètement et élégamment.</span></span></p>', 'porte-couches-diaper-organisateur', 'Porte-couches diaper organisateur, pour avoir les couches de votre bébé en main', '', 'Gardez les couches, utilisez-les pour garder les couches de votre bébé propres et pratiques. Nos couches sont si belles qu\'elles décorent l\'espace des enfants.'),
(233, 1, 1, 'Diaper and wipes pouch', '<p><span id=\"result_box\" xml:lang=\"en\" lang=\"en\"><span>Case for diapers and wipes, to carry everything neat inside your bag.</span><br /><br /><span>Our diaper bags are made with your favorite printed fabric from our catalog.</span><br /><br /><span>Carry diapers and wipes in a simple and elegant way during your baby\'s walks, with our personalized diaper bags.</span></span></p>', 'diaper-and-wipes-pouch', 'Diaper case with your favorite printed fabric', '', 'Diaper bags, to carry your baby\'s diapers well organized, during walks or trips. Made for you with your favorite printed fabric from our catalog.'),
(233, 1, 3, 'Estuche para pañales', '<p>Estuche para pañales y toallitas, para llevar todo ordenado dentro de tu bolso.</p>', 'estuche-para-panales', 'Estuche para pañales con tu tela estampada favorita', '', 'Bolsas porta pañales, para llevar bien organizdos los pañales de tu bebe, durante los paseos o viajes. Confeccionados para ti con tu tela estampada favorita de nuestro catálogo.'),
(233, 1, 4, 'Pochette de transport pour couches et lingettes', '<p><span id=\"result_box\" xml:lang=\"fr\" lang=\"fr\"><span>Etui pour les couches et les lingettes, pour tout transporter dans votre sac.</span><br /><br /><span>Nos sacs à couches sont fabriqués avec votre tissu imprimé préféré de notre catalogue.</span><br /><br /><span>Transportez des couches et des lingettes de manière simple et élégante pendant les promenades de votre bébé, grâce à nos sacs à couches personnalisés.</span></span></p>', 'pochette-de-transport-pour-couches-et-lingettes', 'Étui à couches avec votre tissu imprimé préféré', '', 'Sacs à langer, pour porter les couches de votre bébé bien organisé, lors de promenades ou de voyages. Fabriqué pour vous avec votre tissu imprimé préféré de notre catalogue'),
(234, 1, 1, 'Bugaboo Camaleon', '<p> </p>\n<p>We have all the fabric accesories you need to  make your Bugaboo Cameleon Stroller unique.</p>\n<p></p>\n<p>We can custom all the bugaboo camelon versions, 1, 2, 3  and limited editions.</p>\n<p></p>\n<p>We are specialist in customizing bugaboo cameleon strollers.</p>\n<p></p>\n<p>From carrycot to chair, we can handmade the accesories you need to give your Bugaboo cameleon your own style.</p>\n<p></p>\n<p>We can make summer and Winter cover with anny of our prints from our cotton fabric catalogue.</p>\n<p></p>\n<p>You choose your style and we´ll custom your bugaboo camelon for you.</p>', 'bugaboo-camaleon', 'Bugaboo Cameleon covers - different things for different parents!', '', 'We have all the fabric accesories you need to  make your Bugaboo Cameleon Stroller unique.\r\nWe can custom all the bugaboo camelon versions.\r\n\r\n\r\n\r\n\r\n\r\n'),
(234, 1, 3, 'BUGABOO CAMALEON', '<h2>Fundas Bugaboo Camaleon - accesorios diferentes para padres diferentes!</h2>', 'bugaboo-camaleon', 'Fundas Bugaboo Camaleon con tu tela favorita', '', 'Accesorios Bugaboo Camaleon 1, 2, 3 y plus. Cosemos fundas, sacos y capotas para el Bugaboo Camaleon a medida. ¡Personaliza tu Bugaboo!'),
(234, 1, 4, 'Bugaboo Camaleon', '<p>Nous avons tous les accessoires en tissu que vous besoin pour faire unique votre Bugaboo Camelon poussette.</p>\n<p>Nous pouvons faire pour vous tous les accessoires du poussette bugaboo cameloen avec votre imprimé favorie.<br /> Faites-vous votre bugaboo cameleon poussette unique et différent. Avec notre tissu en coton</p>\n<p>Vous pouvez changer votre capote, housse, nacellecoussin confort…..</p>\n<p>Nous pouvons lui faire des housses d\'été et d\'hiver</p>', 'bugaboo-camaleon', 'Couvertures Bugaboo Cameleon - différentes choses pour différents parents!', '', 'Nous avons tous les accessoires en tissu que vous besoin pour faire unique votre Bugaboo Camelon poussette.\r\n\r\n'),
(235, 1, 1, 'Bugaboo Buffalo', '<p>We have all the fabric accesories you need to make your Bugaboo Buffalo Stroller unique.</p>\n<p>We can custom all the bugaboo Buffalo and limited editions.</p>\n<p>We are specialist in customizing bugaboo Buffalo strollers.</p>\n<p>From carrycot to chair, we can handmade the accesories you need to give your Bugaboo Buffalo your own style.</p>\n<p>We can make summer and Winter cover with anny of our prints from our cotton fabric catalogue.</p>\n<p>You choose your style and we´ll custom your bugaboo Buffalo for you.</p>', 'bugaboo-buffalo', 'Bugaboo Buffalo - covers, strollerbags and accessories to change it', '', 'We have all the fabric accesories you need to make your Bugaboo Buffalo Stroller unique. We are specialist in customizing bugaboo Buffalo strollers.'),
(235, 1, 3, 'BUGABOO BUFFALO', '<h2>Viste tu Bugaboo Buffalo: capotas, sabanas, cobertores, sacos de verano o de invierno, ect.</h2>', 'bugaboo-buffalo', 'Bugaboo Buffalo - fundas con tu tela favorita', '', 'Bugaboo Buffalo: accesorios modernos, originales y únicos para tu cochecito. Fuimos los primeros en Europa en personalizar la silla Bugaboo Buffalo! Capotas, sabanas, colchas, sacos, fundas, todo para que tu Buffalo sea único y diferente.'),
(303, 1, 4, 'BOLSOS BUGABOO', '', 'bolsos-bugaboo', '', '', ''),
(235, 1, 4, 'Bugaboo Buffalo', '<p> </p>\n<p>Nous avons tous les accessoires en tissu que vous besoin pour faire unique votre Bugaboo Buffalo poussette.</p>\n<p>Nous pouvons faire pour vous tous les accessoires du poussette bugaboo Buffalo avec votre imprimé favori.<br /> Faites-vous votre bugaboo Buffalo poussette unique et différent. Avec notre tissu en coton</p>\n<p>Vous pouvez changer votre capote, housse, nacelle, coussin confort…..</p>\n<p>Nous pouvons lui faire des housses d\'été et d\'hiver</p>', 'bugaboo-buffalo', 'Bugaboo Buffalo - housses, poussettes et accessoires pour le renouveler', '', 'Nous avons tous les accessoires en tissu que vous besoin pour faire unique votre Bugaboo Buffalo poussette.\r\nNous pouvons faire pour vous des capotes, des housses'),
(236, 1, 1, 'Bugaboo Donkey', '<p>We have all the fabric accesories you need to make your Bugaboo Donkey pushchair unique.</p>\n<p>We can custom all the bugaboo Donkey strollers and limited editions.</p>\n<p>We are specialist in customizing bugaboo Donkey pushchairs.</p>\n<p>From carrycot to chair, we can handmade the accesories you need to give your Bugaboo Donkey your own style.</p>\n<p>We can make summer and Winter cover with anny of our prints from our cotton fabric catalogue.</p>\n<p>You choose your style and we´ll custom your bugaboo Donkey for you.</p>', 'bugaboo-donkey', 'Bugaboo Donkey - covers, strollerbags and accessories to renew it', '', 'We have all the fabric accesories you need to make your Bugaboo Donkey pushchair unique.\r\nWe are specialist in customizing bugaboo Donkey pushchair'),
(236, 1, 3, 'BUGABOO DONKEY', '<h2>Todos los accesorios textiles para hacer único tu cochecito Bugaboo Donkey.</h2>', 'bugaboo-donkey', 'Fundas y accesorios para Bugabo Donkey', '', 'Bugaboo DONKEY: accesorios modernos, originales y únicos para tu cochecito. Nos encanta esta silla gemelar, y tras personalizarla con una funda, una colcha, una capota o un saco, tu sillita Donkey sera unica y especial. Tu eliges tu estilo.'),
(236, 1, 4, 'Bugaboo Donkey', '<p>Nous avons tous les accessoires en tissu que vous besoin pour faire unique votre Bugaboo Donkey poussette.</p>\n<p>Nous pouvons faire pour vous tous les accessoires du poussette bugaboo Donkey avec votre imprimé favori.<br /> Faites-vous votre bugaboo Donkey poussette unique et différent. Avec notre tissu en coton</p>\n<p>Vous pouvez changer votre capote, housse, nacelle, coussin confort…..</p>\n<p>Nous pouvons lui faire des housses d\'été et d\'hiver</p>\n<p> </p>', 'bugaboo-donkey', 'Bugaboo Donkey - housses, poussettes et accessoires pour le renouveler', '', 'Nous avons tous les accessoires en tissu que vous besoin pour faire unique votre Bugaboo Donkey poussette. Vous pouvez changer votre capote, housse, …..'),
(237, 1, 1, 'Bugaboo Bee', '', 'bugaboo-bee', 'Bugaboo Bee - custom Bugaboo Bee cases', '', ''),
(237, 1, 3, 'BUGABOO BEE', '<h2>Dale un look personalizado a tu Bugaboo Bee y haz que tu carrito tenga tu estilo personal.</h2>', 'bugaboo-bee', 'Bugaboo Bee - fundas Bugaboo Bee personalizadas', '', 'Accesorios modernos, originales y únicos para tu cochecito Bugaboo Bee. Llevamos mas de 10 años diseñando fundas personalizadas para Bugaboo Bee con tu estampado favorito. Haz tu cochecito Bugaboo Bee unico y diferente.'),
(237, 1, 4, 'Bugaboo Bee', '<p>Nous avons tous les accessoires en tissu que vous besoin pour faire unique votre Bugaboo BEE poussette.</p>\n<p>Nous pouvons personnaliser toutes les versions de Bugaboo BEE 1, +, 3 y 5.</p>\n<p>Nous pouvons faire pour vous tous les accessoires du poussette bugaboo BEE avec votre imprimé favori.<br /> Faites-vous votre bugaboo BEE poussette unique et différent. Avec notre tissu en coton</p>\n<p>Vous pouvez changer votre capote, housse, nacelle, coussin confort…..</p>\n<p>Nous pouvons lui faire des housses d\'été et d\'hiver</p>', 'bugaboo-bee', 'Bugaboo Bee - Etuis Bugaboo Bee personnalisés', '', 'Nous avons tous les accessoires en tissu que vous besoin pour faire unique votre Bugaboo BEE poussette. Toutes les versions de Bugaboo BEE 1, +, 3 y 5.'),
(238, 1, 1, 'Bugaboo Buffalo canopies', '', 'bugaboo-buffalo-canopies', '', '', ''),
(238, 1, 3, 'Capotas Bugaboo Buffalo', '<h2 style=\"text-align:left;\"><strong>Capotas Bugaboo Buffalo</strong> con tu estampado favorito.</h2>', 'capotas-bugaboo-buffalo', 'Capotas Bugaboo Buffalo - elegantes y diferentes ', '', 'Capotas para Bugaboo Buffalo. Cambia el estilo de tu carrito con nuestras originales capotas para Bugaboo  Buffalo. Tu eliges tu estampado favorito y nosotros confeccionamos la capota con tu estilo personal. Fabricado con mucho amor en España.'),
(238, 1, 4, 'Capotes Bugaboo Buffalo', '', 'capotes-bugaboo-buffalo', '', '', ''),
(239, 1, 1, 'Bugaboo Buffalo seat liner', '<p>Bugaboo Buffalo stroller seat covers – treat your baby with an exclusive Design.</p>\n<p>Custom bugaboo Buffalo seat liners, renew your baby stroller with your personal touch.</p>\n<p>Make your bugaboo Buffalo unique with our huge super soft cotton fabric catologue.</p>\n<p>Choose your favorite print, geometric, flowers, stars, dinos…and we´ll make it for you,</p>\n<p>We have bugaboo Buffalo Liners that are just 1 piece, (cover the back) and 2 pieces seat liners( cover back and seat)</p>\n<p>They are really easy to wear.</p>\n<p>Dress up your Bugaboo Buffalo Stroller and make it the one and only.</p>', 'bugaboo-buffalo-seat-liner', '', '', 'Bugaboo Buffalo stroller seat covers – treat your baby with an exclusive Design.Custom bugaboo Buffalo seat liners, renew your baby stroller with your personal touch.\r\n\r\n\r\n'),
(239, 1, 3, 'Fundas Bugaboo Buffalo', '<h2 style=\"text-align:left;\"><strong>Fundas Bugaboo Buffalo</strong> - mima a tu bebe con un diseño exclusivo.</h2>', 'fundas-bugaboo-buffalo', 'Fundas Bugaboo Buffalo con tu estampado favorito', '', 'Fundas Bugaboo Buffalo modernas y diferentes. Cambia el estilo de tu Bugaboo Buffalo con una funda confeccionada a medida con tu tela estampada favorita. Tejidos muy suaves y con diferentes diseños. Fundas confeccionadas en España con mucho love!'),
(239, 1, 4, 'Housse pour Bugaboo Buffalo', '<p>Personnalisez votre Housse pour Bugaboo Buffalo. </p>\n<p>Si vous n\'aimez pas l\'uniformité et que vous voulez donner une touche différente à votre poussette Bugaboo Buffalo, nos housses la rendront unique et spéciale. Housses personnalisées pour Bugaboo Buffalo avec douce tisu a coton, elles s\'y ajustent parfaitement, choisissez le tissu qui vous plaît le plus et mettez en valeur votre poussette de manière originale.  </p>\n<p>Housse avec 2 piéces, cette housse est dessiné pour customiser votre poussette, et donner à votre bugaboo Buffalo a unique look.<br /> Fait a main avec votre  tisu de coton favorite.<br /> Il s\'adaptent parfaitement à votre poussette et protège la peau délicate de bébé du contact avec les fibres synthétiques du siège</p>\n<p> </p>', 'housse-pour-bugaboo-buffalo', '', '', 'Si vous n\'aimez pas l\'uniformité et que vous voulez donner une touche différente à votre poussette Bugaboo Buffalo, nos housses la rendront unique et spéciale'),
(240, 1, 1, 'Bugaboo Buffalo carry cot accesories', '', 'bugaboo-buffalo-carry-cot-accesories', '', '', ''),
(240, 1, 3, 'Capazo Bugaboo Buffalo', '<h2 style=\"text-align:left;\"><strong>Fundas capazo Bugaboo Buffalo</strong>, viste diferente tu Bugaboo Buffalo!</h2>', 'capazo-bugaboo-buffalo', 'Fundas capazo Bugaboo Buffalo - viste tu capazo Buffalo', '', 'Fudas capazo Bugaboo Buffalo con originales estampados. Viste tu cochecito Bugaboo Buffalo con tejidos 100% algodon. Llevamos muchos años especializados en el cochecito Bugaboo Buffalo. Lo hacemos unico segun tu estilo personal.'),
(240, 1, 4, 'Nacelle de Bugaboo Buffalo poussette', '', 'nacelle-de-bugaboo-buffalo-poussette', '', '', ''),
(241, 1, 1, 'Bugaboo Buffalo accesories', '', 'bugaboo-buffalo-accesories', '', '', '');
INSERT INTO `ps_category_lang` (`id_category`, `id_shop`, `id_lang`, `name`, `description`, `link_rewrite`, `meta_title`, `meta_keywords`, `meta_description`) VALUES
(241, 1, 3, 'Accesorios Bugaboo Buffalo', '<h2 style=\"text-align:left;\"><strong>Accesorios Bugaboo Buffalo</strong> - únicos y originales, dale un toque chic a tu Bugaboo Buffalo.</h2>', 'accesorios-bugaboo-buffalo', 'Accesorios Bugaboo Buffalo: renueva tu silla!', '', 'Accesorios Bugaboo Buffalo modernos y unicos para personalizar tu silla Bugaboo. Fundas para reposabrazos, fundas para el manillar, protectores de cinturon, todo lo que puedas imaginar para hacer tu cochecito Bugaboo Buffalo unico y diferente.'),
(241, 1, 4, 'Des accessoires pour Bugaboo Buffalo', '', 'des-accessoires-pour-bugaboo-buffalo', '', '', ''),
(242, 1, 1, 'Bugaboo Buffalo sets', '', 'bugaboo-buffalo-sets', '', '', ''),
(242, 1, 3, 'Vestir Bugaboo Buffalo', '<h2 style=\"text-align:left;\"><strong>Viste tu Bugaboo Buffalo</strong> y expresa el poder de tu estilo personal!</h2>', 'vestir-bugaboo-buffalo', 'Vestir Bugaboo Buffalo - todo a juego para vestir tu Buffalo', '', 'Vestir Bugaboo Buffalo para que tu bebé este comodo y confortable dentro del cochecito. Elige tu tela favorita y personaliza tu Bugaboo Buffalo para que sea unico. Llevamos muchos años confeccionando fundas para Bugaboo Buffalo con mucho love!'),
