(243, 1, 1, 'Padded seat liner Bugaboo BUFFALO', '', 'padded-seat-liner-bugaboo-buffalo', '', '', ''),
(243, 1, 3, 'Colchoneta Bugaboo Buffalo', '<h2 style=\"text-align:left;\"><strong>Colchoneta silla Bugaboo Buffalo</strong> - lleva a tu bebé fresquito y cómodo.</h2>', 'colchoneta-bugaboo-buffalo', 'Colchoneta silla Bugaboo Buffalo - modernas y únicas', '', 'Colchoneta silla Bugaboo Buffalo para renovar el aspecto de tu silla. Confeccionadas en algodon 100% Ellige tu estampado favorito, tenemos mas de 100 diferentes. Haz tu Bugaboo Buffalo unico y diferente segun tu estilo personal!'),
