(244, 1, 1, 'Bugaboo Donkey canopies', '', 'bugaboo-donkey-canopies', '', '', ''),
(244, 1, 3, 'Capotas Bugaboo Donkey', '<h2 style=\"text-align:left;\"><strong>Capotas Bugaboo Donkey</strong> con tu estampado favorito.</h2>', 'capotas-bugaboo-donkey', 'Capotas Bugaboo Donkey', '', 'Capotas Bugaboo Donkey diferentes y exclusivas. Elige tu estampado favorito de nuestro catalogo: calaveras, corazones, topos, dulces animalitos... tenemos diferentes diseños para adaptarnos a tus gustos. Haz que tu Bugaboo Donkey sea diferente y unico!'),
(244, 1, 4, 'Capotes Bugaboo Donkey', '', 'capotes-bugaboo-donkey', '', '', ''),
(245, 1, 1, 'Bugaboo Donkey seat liner', '<p>Bugaboo Donkey stroller seat covers – treat your baby with an exclusive Design.</p>\n<p>Custom bugaboo Donkey seat liners, renew your baby stroller with your personal touch.</p>\n<p>Make your bugaboo Donkey unique with our huge super soft cotton fabric catologue.</p>\n<p>Choose your favorite print, geometric, flowers, stars, dinos…and we´ll make it for you,</p>\n<p>We have bugaboo covers that are just 1 piece, the cover the back and 2 pieces covers, back and seat.</p>\n<p>They are really easy to wear.</p>\n<p>Dress up your Bugaboo Donkey Stroller and make it the one and only.</p>', 'bugaboo-donkey-seat-liner', '', '', 'Bugaboo Donkey stroller seat covers – treat your baby with an exclusive Design.Custom bugaboo Donkey seat liners, renew your baby stroller with your  touch.'),
(245, 1, 3, 'Fundas Bugaboo Donkey', '<h2 style=\"text-align:left;\"><strong>Fundas Bugaboo Donkey</strong> - amplia variedad de diseños exclusivos.</h2>', 'fundas-bugaboo-donkey', 'Fundas silla Bugabo Donkey - únicas y diferentes', '', 'Fundas Bugaboo Donkey, confeccionadas con tu estampado favorito. Desde calaveras hasta dulces animalitos. Reestrena tu cochecito Bugaboo Donkey mono, duo o gemelar con una funda diseñada y confeccionada en España con mucho amor!'),
(245, 1, 4, 'Housse pour Bugaboo Donkey', '<p>Personnalisez votre Housse pour Bugaboo Donkey.  Si vous n\'aimez pas l\'uniformité et que vous voulez donner une touche différente à votre poussette Bugaboo Donkey, nos housses la rendront unique et spéciale. Housses personnalisées pour Bugaboo Donkey avec douce tisu a coton, elles s\'y ajustent parfaitement, choisissez le tissu qui vous plaît le plus et mettez en valeur votre poussette de manière originale.  </p>\n<p>Housse avec 2 piéces, cette housse est dessiné pour customiser votre poussette, et donner à votre bugaboo Donkey a unique look.<br /> Fait a main avec votre  tisu de coton favorite.<br /> Il s\'adaptent parfaitement à votre poussette et protège la peau délicate de bébé du contact avec les fibres synthétiques du siège</p>\n<p> </p>', 'housse-pour-bugaboo-donkey', '', '', ' Housses personnalisées pour Bugaboo Donkey avec douce tisu a coton, elles s\'y ajustent parfaitement, choisissez le tissu qui vous plaît le plus .  '),
(246, 1, 1, 'Bugaboo Donkey carry cot accesories', '', 'bugaboo-donkey-carry-cot-accesories', '', '', ''),
(246, 1, 3, 'Capazo Bugaboo Donkey', '<h2 style=\"text-align:left;\"><strong>Fundas capazo Bugaboo Donkey</strong>, viste diferente tu Bugaboo Donkey!</h2>', 'capazo-bugaboo-donkey', 'Fundas  para capazo Bugaboo Donkey mono o gemelar ', '', 'Hacemos que tu capazo Bugaboo Donkey sea el captador de todas las miradas. Cosemos fundas para el capazo Bugaboo Donkey con tu diseño favorito de nuestro catalogo de telas. Desde estrellitas, topitos, calaveras, dulces animales, ect tu eliges tu estilo!'),
(246, 1, 4, 'Nacelle de Bugaboo Donkey poussette', '', 'nacelle-de-bugaboo-donkey-poussette', '', '', ''),
(247, 1, 1, 'Bugaboo Donnkey accesories', '', 'bugaboo-donnkey-accesories', '', '', ''),
(247, 1, 3, 'Accesorios Bugaboo Donnkey', '<h2 style=\"text-align:left;\"><strong>Accesorios Bugaboo Donkey</strong> - únicos y originales, dale un toque chic a tu Bugaboo Donkey.</h2>', 'accesorios-bugaboo-donnkey', 'Accesorios Bugaboo Donkey', '', 'Accesorios Bugaboo modernos y unicos para personalizar tu silla Donkey. Fundas para reposabrazos, fundas para el manillar, protectores de cinturon, todo lo que puedas imaginar para hacer tu cochecito Bugaboo Donkey unico y diferente segun tu estilo.'),
(247, 1, 4, 'Des accessoires pour Bugaboo Donkey', '', 'des-accessoires-pour-bugaboo-donkey', '', '', ''),
(248, 1, 1, 'Bugaboo Donkey sets', '', 'bugaboo-donkey-sets', '', '', ''),
(248, 1, 3, 'Vestir Bugaboo Donkey', '<h2 style=\"text-align:left;\"><strong>Viste tu Bugaboo Donkey</strong> y expresa el poder de tu estilo personal!</h2>', 'vestir-bugaboo-donkey', 'Vestir Bugaboo Donkey - todo a juego para vestir tu Donkey', '', 'Vestir Bugaboo Donkey para que tu bebé este comodo y mimado dentro del cochecito. Elige tu tela favorita y personaliza tu Bugaboo Donkey para que sea unico. Nuestra experiencia con el cochecito Donkey nos avala! Fundas para Bugaboo Donkey con mucho love!'),
