(250, 1, 3, 'Capotas Bugaboo Bee', '<h2 style=\"text-align:left;\"><strong>Capotas Bugaboo Bee</strong> con tu estampado favorito.</h2>', 'capotas-bugaboo-bee', 'Capotas Bugaboo Bee - diferentes y exclusivas como tu bebe!', '', 'Cambia la capota de tu Bugaboo Bee y haz que tu sillita tenga un aspecto unico y diferente. Cosemos capotas para el Bugaboo Bee personalizadas. Elige tu dibujo favorito de nuestro catalogo de telas y renueva tu Bee. Mas de 100 estampados diferentes!'),
(250, 1, 4, 'Capotes Bugaboo Bee', '', 'capotes-bugaboo-bee', '', '', ''),
(251, 1, 1, 'Bugaboo Bee seat liner', '', 'bugaboo-bee-seat-liner', '', '', ''),
(251, 1, 3, 'Fundas Bugaboo Bee', '<h2 style=\"text-align:left;\"><strong>Fundas Bugaboo Bee</strong> - mima a tu bebe con un diseño exclusivo.</h2>', 'fundas-bugaboo-bee', 'Fundas Bugaboo Bee - elige tu estampado favorito', '', 'Fundas Bugaboo Bee modernas y diferentes. Cambia el estilo de tu Bugaboo Bee con una funda confeccionada a medida con tu tela estampada favorita. Tejidos muy suaves y con diferentes diseños. Fundas confeccionadas en España con mucho love!'),
