(253, 1, 1, 'Bugaboo Frog', '<p>We have all the fabric accesories you need to make your Bugaboo FROG pushchair unique.</p>\n<p>We can custom all the bugaboo FROG strollers and limited editions.</p>\n<p>We are specialist in customizing bugaboo FROG pushchairs.</p>\n<p>From carrycot to chair, we can handmade the accesories you need to give your Bugaboo FROG your own style.</p>\n<p>We can make summer and Winter cover with anny of our prints from our cotton fabric catalogue.</p>\n<p>You choose your style and we´ll custom your bugaboo FROG for you.</p>', 'bugaboo-frog', 'Bugaboo Frog - covers, strollerbags and accessories to renew it', '', 'We have all the fabric accesories you need to make your Bugaboo FROG pushchair unique.\r\nWe are specialist in customizing bugaboo FROG pushchairs.'),
(253, 1, 3, 'BUGABOO FROG', '<h2>Dale un look personalizado a tu <strong>Bugaboo Frog</strong> y haz que tu carrito tenga tu estilo personal.</h2>', 'bugaboo-frog', 'Bugaboo Frog - fundas, sacos y accesorios para renovarlo', '', 'Somos especialistas en confeccionar accesorios unicos para tu Bugaboo Frog. Hacemos para esta sillita fundas, colchas, capotas, sacos, y todo lo que sirva para mimar a tu bebe. Confeccionado en España con mucho amor con tu estilo personal.'),
(253, 1, 4, 'Bugaboo Frog', '<p>Nous avons tous les accessoires en tissu que vous besoin pour faire unique votre Bugaboo FROG poussette.</p>\n<p>Nous pouvons personnaliser toutes les versions de Bugaboo FROG</p>\n<p>Nous pouvons faire pour vous tous les accessoires du poussette bugaboo FROG avec votre imprimé favori.<br /> Faites-vous votre bugaboo FROG poussette unique et différent Avec notre tissu en coton</p>\n<p>Vous pouvez changer votre capote, housse, nacelle, coussin confort…..</p>\n<p>Nous pouvons lui faire des housses d\'été et d\'hiver</p>', 'bugaboo-frog', 'Bugaboo Frog - housses, poussettes et accessoires pour le renouveler', '', 'Nous avons tous les accessoires en tissu que vous besoin pour faire unique votre Bugaboo FROG poussette.\r\n'),
(254, 1, 1, 'Footmuff for Bugaboo Camaleon', '', 'footmuff-for-bugaboo-camaleon', '', '', ''),
(254, 1, 3, 'SACOS BUGABOO', '<h2>Sacos personalizados para el carrito Bugaboo Camaleon.</h2>', 'sacos-bugaboo', 'Sacos Bugaboo Camaleon con tu estampado favorito', '', 'Sacos Bugaboo Camaleon a medida para tu carrito. Diferencia tu Bugaboo Camaleon del resto con nuestros sacos personalizados a tu gusto.'),
