(258, 1, 1, 'JANE MICRO CAPAZO', '', 'jane-micro-capazo', 'Carry cot Jane Micro - covers to love your baby', '', ''),
(258, 1, 3, 'CAPAZO JANE MICRO', '<h2 style=\"text-align:left;\"><strong>Fundas capazo Jané Micro</strong>, viste diferente tu carrito Jané!</h2>', 'capazo-jane-micro', 'Capazo Jane Micro - fundas a medida', '', 'Fundas con tu tela favorita de nuestro catalogo para dar un toque diferente y especial a tu carrito Jane Micro (Muum, Rider, Minum...). Cambia por completo el estilo de tu cuco Jane Micro. Hacemos la funda del capazo Jane Micro, su capota, la sabana...'),
(258, 1, 4, 'JANE MICRO CAPAZO', '', 'jane-micro-capazo', 'Nacelle Jane Micro - changer le look de votre nacelle', '', ''),
(259, 1, 1, 'MOUNTAIN BUGGY', '<p><span id=\"result_box\" xml:lang=\"en\" lang=\"en\"><span>All the accessories more cool to make your Mountain Buggy stroller unique and different.</span></span></p>', 'mountain-buggy', 'Mountain Buggy - covers, mats and bags', '', 'Mountain Buggy unique and different! Customize your Mountain Buggy twin stroller with our fun textiles, to renew or change the look of your twin stroller completely. We have covers, mattresses and bags, to pamper your little ones and completely change the style of your Mountain Buggy.'),
(259, 1, 3, 'FUNDAS MOUNTAIN BUGGY', '<h2>Fundas Mountain Buggy - hacemos que tu carrito gemelar luzca diferente y especial.</h2>', 'fundas-mountain-buggy', 'Mountain Buggy - fundas, colchonetas y sacos ', '', 'Mountain Buggy unico y diferente! Personaliza tu carrito gemelar Mountain Buggy con nuetros divertidos textiles, para renovar o cambiar el look de tu carrito gemelar por completo. Disponemos de fundas, colchonetas y sacos, para mimar a tu pequeños y cambiar por completo el estilo de tu Mountain Buggy. '),
(259, 1, 4, 'MOUNTAIN BUGGY', '<div id=\"gt-res-content\">\n<div class=\"trans-verified-button-small\" id=\"gt-res-dir-ctr\" dir=\"ltr\"><span id=\"result_box\" xml:lang=\"fr\" lang=\"fr\"><span>Tous les accessoires sont plus cool pour rendre votre poussette Mountain Buggy unique et différent.</span></span></div>\n</div>', 'mountain-buggy', 'Mountain Buggy - couvertures, tapis et sacs', '', 'Mountain Buggy unique et différent! Personnalisez votre chariot double Mountain Buggy avec nos textiles amusants, pour renouveler ou changer complètement l\'allure de votre chariot double. Nous avons des housses, des matelas et des sacs pour chouchouter vos petits et changer complètement le style de votre Mountain Buggy'),
(260, 1, 1, 'Cosmetics Bio for mum and baby', '<p>Cosmetics Bio, form mum and baby</p>', 'cosmetics-bio-for-mum-and-baby', '', '', ''),
(260, 1, 3, 'Cosmética para bebés y mamás', '<p>Cosmética natural y ecológica, 100% principios activos Bio.</p>', 'cosmetica-para-bebes-y-mamas', 'Productos naturales para bebes y embarazadas', '', 'Cosmetica natural y 100% certificada bio para tu piel y la de tu bebé. Aceites y cremas para dar a la piel un aspecto suave y sedoso. Fabricado en España.'),
(260, 1, 4, 'Cosmétiques Bio', '<p>Une cosmétique bio pour Maman et Bébé!</p>', 'cosmetiques-bio', 'Cosmétiques', '', 'Une cosmétique bio pour Maman et Bébé!'),
(261, 1, 1, 'BUGABOO FOX', '', 'bugaboo-fox', 'Bugaboo Fox - cover differents for your stroller', '', ''),
(261, 1, 3, 'BUGABOO FOX', '<h2>Si deseas cambiar el aspecto de tu carro Bugaboo Fox podemos hacerlo según tu estilo!</h2>', 'bugaboo-fox', 'Bugaboo Fox - fundas para hacer único tu carrito Fox', '', 'Somos especialistas en cambiar el aspecto del Bugaboo Fox, con fundas personalizadas a tu gusto. Fundas para capazo y colchonetas Bugaboo Fox.'),
(293, 1, 4, 'EASYWALKER ACCESORIOS', '', 'easywalker-accesorios', '', '', ''),
(294, 1, 1, 'EXTENSION CAPOTA UNIVERSAL', '', 'extension-capota-universal', '', '', ''),
(294, 1, 3, 'EXTENSION CAPOTA UNIVERSAL', '<h2>Accesorio para alargar la capota de la silla de paseo o carrito del bebé.</h2>', 'extension-capota-universal', 'Accesorio para extender la capota del carrito bebé', '', 'Ciertas sillas de paseo presentan una capota pequeña. En esos casos la extensión de capota universal es perfecta para proteger al bebé de los rayos solares.'),
(294, 1, 4, 'EXTENSION CAPOTA UNIVERSAL', '', 'extension-capota-universal', '', '', ''),
(261, 1, 4, 'BUGABOO FOX', '', 'bugaboo-fox', 'Bugaboo Fox - coussins différents pour votre poussette', '', ''),
(262, 1, 1, 'Concord Neo footmuff', '<p>The most beautiful footmufs to make your Concord Neo stroller the cosiest place for your baby.</p>\n<p>We handmade our footmuffs for Concord Neo stroller to fit perfectly.</p>\n<p>We have Concord Neo winter and mid-season footmuffs.</p>\n<p>The Concord Neo winter footmuffs have a thick padding to keep your baby warm in winter.</p>\n<p>With soft flece inside.</p>\n<p>We also have light footmuffs, taht you can use as a seat cover.</p>\n<p>All  of them made with the fabric that you like best from our catalog of prints.</p>', 'concord-neo-footmuff', 'The most beautiful handmade footmufs for your Concord Neo stroller   ', '', 'The most beautiful winter and mid-season footmufs to make your Concord Neo stroller the cosiest place for your baby.We handmade our footmuffs for Concord Neo stroller to fit perfectly.All  of them handmade with the fabric that you like best from our catalog of prints.'),
(262, 1, 3, 'Saco Concord Neo', '<h2>Los sacos mas bonitos para hacer tu silla Concord Neo el mejor lugar para tu bebé.</h2>', 'saco-silla-concord-neo', 'Saco silla Concord Neo  ♥ modernos y confortables ♥', '', 'Descubre nuestros sacos para silla Concor Neo. Son ideales para dar un toque de color y alegria a tu silla Concord Neo. Disponemos de sacos para invierno, con un robusto relleno y tejidos de pelito super abrigados. Y tambien de sacos de verano o entretiempo. Todos ellos se convierten en funda, para mimar a tu bebé!'),
(262, 1, 4, 'Chanceliére pour Concord Neo', '<p>Les plus beaux chanceliére pour faire de votre poussette Concord Neo le meilleur endroit pour votre bébé.</p>\n<p>Nous avons conçu le chanceliére pour la poussette Concord Neo de façon à ce qu’il s’adapte parfaitement à votre poussette.</p>\n<p>Nous avons des chanceliéres Concord Neo pour l’hiver et la mi-saison.</p>\n<p>Les chanceliéres d’hiver Concord Neo ont un rembourrage épais pour garder votre bébé au chaud en hiver.</p>\n<p>Avec un intérieur en fourrure douce que vous ne pouvez pas arrêter de caresser.</p>\n<p>Nous avons également des sacs pour Concord Neo, convertibles en housse.</p>\n<p>Tous fabriqués avec le tissu que vous préférez de notre catalogue d\'imprimés.</p>', 'chanceliere-pour-concord-neo', 'Les plus beaux chanceliére d\'hiver et été pour  poussette Concord Neo ', '', 'Les plus beaux chanceliére pour faire de votre poussette Concord Neo le meilleur endroit pour votre bébé.Nous avons conçu le chanceliére pour la poussette Concord Neo de façon à ce qu’il s’adapte parfaitement à votre poussette.Nous avons des chanceliéres Concord Neo pour l’hiver et la mi-saison. '),
(263, 1, 3, 'MANOPLAS CARRO BEBÉ', '<h2>Manoplas y guantes cálidos y acogedores, para carro de bebé.</h2>', 'manoplas-carro-bebe', 'Manoplas carro bebe - a medidda para tu carrito', '', 'Manoplas para el carrito del bebe, con tu tela favorita de nuestro catálogo. Disponibles online. Fabricadas en España.'),
(263, 1, 4, 'Gants de poussette', '<div id=\"short_description_content\" class=\"rte align_justify\">\n<p>Gants de poussette, Ils sont fixées au guidon de votre poussette de manière simple et efficace et garderont vos mains au chaud tout en profitant d\'agréables promenades.Que le froid ne vous empêche pas de profiter de la promenade avec votre bébé. Ils sont accrochés au guidon et vous pouvez insérer et retirer vos mains sans risque de les perdre.Promener avec votre bébé n\'a jamais été aussi confortable et élégant!</p>\n</div>\n<p></p>\n<p></p>', 'gants-de-poussette', 'moufles de poussette amoureuses, ils garderont vos mains au chaud ', '', 'gants de poussette super-amoureuses,  garderont vos mains au chaud tout en profitant d\'agréables promenades.Ils sont accrochés au guidon.'),
