(265, 1, 3, 'Muestras de telas', '<p>Sabemos lo dificil que es decidir entre todos los estampados que tenemos disponibles en nuestra tienda para personalizar tu producto favorito de Teoyleo. Por esa razón ofrecemos el servicio de muestras de telas.</p>', 'muestras-de-telas', 'Servicio de muestras de tela para confección - Teoyleo', '', 'Muestras de telas para que puedas ver en directo nuestros estampados y decidir cual de todos encaja mejor con tus gustos.'),
