(266, 1, 1, 'UNIVERSAL COVERS FOR CARRYCOT', '', 'universal-covers-for-carrycot', '', '', ''),
(266, 1, 3, 'FUNDAS UNIVERSALES', '<h2>Fundas carritos bebé universales - para cualquier marca de carrito!</h2>', 'fundas-universales', 'Fundas carritos bebé universales', '', 'Fundas universales para todas las marcas de sillas de paseo. Fundas para silla de paseo universales confeccionadas a medida.'),
