(268, 1, 3, 'CUBRE CAPAZO COCHECITO A MEDIDA', '<h2>Mima a tu bebé con un cubre capazo personalizado con la tela que mas te guste de nuestro catálogo de telas.</h2>\n<p>Confeccionamos los cubre pies del capazo a medida de tu carrito, haz que tu estilo sea único y diferente!</p>', 'cubre-capazo-cochecito-a-medida', 'Cubre capazo universal con tu diseño favorito - Teoyleo', '', 'Cubre capazo universal confeccionado a medida con tu tela estampada favorita de nuestro catálogo. Haz único tu carrito bebé!'),
