(269, 1, 3, 'SABANAS BAJERAS CAPAZO', '<h2>Sabana bajera capazo - mima a tu bebé y haz único tu carrito!</h2>', 'sabanas-bajeras-capazo', 'Sabanas bajeras capazo - a medida para tu carrito', '', 'Mima a tu bebé con las sabanas bajeras para capazo mas bonitas. Las cosemos a medida de tu capazo con la tela estampada que mas te guste!'),
