(270, 1, 3, 'FUNDA REPOSABRAZOS UNIVERSAL', '<h2>Fundas a medida para la barra apoyabrazos con tu tela estampada favorita!</h2>', 'funda-reposabrazos-universal', 'Funda para el reposabrazos de tu carrito', '', 'Funda reposabrazos universal para proteger el apoyabrazos. La confeccionamos a medida de tu carrito con tu estampado favorito.'),
