(273, 1, 3, 'FUNDAS BABYZEN YOYO', '<h2>Fundas Yoyo Babyzen - descubre como cambiar el aspecto de tu carrito</h2>', 'fundas-babyzen-yoyo', 'Funda Babyzen Yoyo - fundas a medida únicas', 'yoyo,babyzen,babyzenyoyo', 'Somos especialistas en personalizar el carrito Babyzen Yoyo. Nuestras colchonetas y sacos son los favoritos de padres y bebes!'),
(273, 1, 4, 'COUVERTURES BABYZEN YOYO', '', 'couvertures-babyzen-yoyo', '', '', ''),
(274, 1, 1, 'Babywearing cover', '<p><span class=\"tlid-translation translation\" xml:lang=\"en\" lang=\"en\"><span title=\"\">Babywearing covers to carry your baby warm in winter while use your baby carrier.</span><br /><br /><span title=\"\">Discover our different models to keep your little one warm.</span><br /><br /><span title=\"\">We have babywearing coats of different designs, materials and thicknesses.</span></span></p>', 'babywearing-cover', 'Babywearing cover - wrap your baby while carrying', '', 'While carrying your baby in cold places we recommend using the babywearing covers, which provide an extra coat.'),
(274, 1, 3, 'Cobertor porteo', '<h2>Cobertores de porteo - lleva bien abrigado a tu bebé en invierno.</h2>\n<p>Portear en invierno puede dar pereza debido al frío. Para no limitar los movimientos lo mas cómodo son los cobertores de porteo. Gracias a ellos puedes abrigarte al mismo tiempo a ti y a tu bebé.</p>', 'cobertor-porteo', 'Cobertor de porteo para abrigar a tu bebé', '', 'Descubre el mejor cobertor de porteo para tu bebé. Personalizado para ti con tu estampado favorito.'),
(274, 1, 4, 'Housse de portage', '<p><span class=\"tlid-translation translation\" xml:lang=\"fr\" lang=\"fr\"><span title=\"\">Des porteurs pour porter votre bébé au chaud en hiver tout en le portant.</span><br /><br /><span title=\"\">Découvrez nos différents modèles pour garder votre petit au chaud.</span><br /><br /><span title=\"\">Nous avons des manteaux de porteurs de différents modèles, matériaux et épaisseurs.</span></span></p>', 'housse-de-portage', 'Porter housse - envelopper votre bébé tout en portant', '', 'Lorsque vous transportez votre bébé dans des endroits froids, nous vous recommandons d\'utiliser les housses de porteur, qui offrent une couche supplémentaire.'),
(275, 1, 1, 'Toy baby carrier', '<p><span class=\"tlid-translation translation\" xml:lang=\"en\" lang=\"en\"><span title=\"\">A toy carrier babycarrier will be the perfect gift for those little ones who play to imitate their parents.</span><br /><br /><span title=\"\">With the same design and style that older people\'s babycarriers can carry their favorite dolls.</span></span></p>', 'toy-baby-carrier', 'Toy baby carrier', '', 'If your little one likes to play imitate you, our toy baby backpacks will love it! To wear your favorite doll.'),
(275, 1, 3, 'Mochila portabebes juguete', '<h2>Mochila portabebes para jugar!</h2>', 'mochila-portabebes-juguete', 'Mochila portabebes juguete', '', 'Si a tu peque le guste jugar a imitarte, nuestros mochilas portabebes de juguete le encantaran! Para llevar a su muñeca favorita.'),
(275, 1, 4, 'Porte poupée jouet', '<p><span class=\"tlid-translation translation\" xml:lang=\"fr\" lang=\"fr\"><span title=\"\">Un sac à dos porte-jouets sera le cadeau idéal pour ces petits qui jouent à imiter leurs parents.</span><br /><br /><span title=\"\">Avec le même design et le même style que les sacs à dos des personnes âgées, ils peuvent transporter leurs poupées et animaux en peluche préférés.</span></span></p>', 'porte-poupee-jouet', 'Porte poupée jouet', '', 'Si votre petit aime jouer à vous imiter, nos sacs à dos jouets vont adorer! Porter votre poupée préférée.'),
(276, 1, 1, 'COJIN DE LACTANCIA', '', 'cojin-de-lactancia', '', '', ''),
(276, 1, 3, 'COJIN DE LACTANCIA', '<h2>Cojines de lactancia personalizados - con tu estampado favorito</h2>', 'cojin-de-lactancia', 'Cojin de lactancia', '', 'Descubre por qué nuestros cojines de lactancia son los favoritos de bebes y mamas! Diseños únicos, tejidos naturales. Evita dolores de espalda ya!'),
(276, 1, 4, 'COJIN DE LACTANCIA', '', 'cojin-de-lactancia', '', '', ''),
(291, 1, 1, 'Bolso organizador silla paseo', '', 'bolso-organizador-silla-paseo', '', '', ''),
(291, 1, 3, 'Bolso organizador silla paseo', '<h2>¡Bolso organizador carrito para llevar lo imprescindible!</h2>', 'bolso-organizador-silla-paseo', 'Bolso organizador silla paseo bebé - personalizado', '', 'Bolso organizador para silla de paseo: exclusivos y ligeros. Bolso para silla ligera, para cuando tu bebé es mayor y no necesitas llevar la casa encima!'),
(277, 1, 1, 'ANTI ROLLOVER CUSHION', '', 'anti-rollover-cushion', '', '', ''),
(277, 1, 3, 'COJÍN ANTIVUELCO ', '<h2>Cojines antivuelco bebés - bonitos y prácticos</h2>', 'cojin-antivuelco', 'Cojín antivuelco para bebé', '', 'Cojín antivuelco para bebé, una forma cómoda y eficaz de conseguir que tu bebé no ruede y descanse a gusto. Hechos en algodón y desenfundables para poder mantenerlos siempre limpios.'),
(277, 1, 4, 'COUSSIN ANTI ROULIS', '', 'coussin-anti-roulis', '', '', ''),
(278, 1, 1, 'Protectores de cinturon acolchado', '', 'protectores-de-cinturon-acolchado', '', '', ''),
(278, 1, 3, 'Protectores de cinturon acolchado', '<h2>Fundas acolchadas para cinturón - con bolsillo secreto!</h2>', 'protectores-de-cinturon-acolchado', 'Protectores para los arneses de la mochila portabebes', '', 'Descubre por qué nuestros protectores acolchados son los favoritos de los padres. Son un accesorio superpráctico para proteger tu mochila durante mas tiempo.'),
(278, 1, 4, 'Protectores de cinturon acolchado', '', 'protectores-de-cinturon-acolchado', '', '', ''),
(279, 1, 1, 'Taller de porteo', '', 'taller-de-porteo', '', '', ''),
(279, 1, 3, 'Taller de porteo', '<h2>Nota importante sobre los talleres</h2>\n<p><span style=\"color:#f5a623;\">Debido a la actual situación de pandemia por el Covid nos es imposible la realización de los talleres de porteo. Durante esta situación especial estamos dando apoyo a las dudas que tengais a traves de nuestras redes sociales y Whatsapp de manera gratutita.</span></p>\n<hr /><p>Disfruta de un rato ameno en buena compañia y aprende a usar un portabebés ergonómico.</p>\n<p>En nuestros talleres te enseñaremos:</p>\n<p style=\"padding-left:30px;\">- Los distintos tipos de portabebes ergonómicos que existen.<br />- Por qué es tan positivo el contacto piel con piel en el porteo ergonómico.<br />- Beneficios para padres y bebés del porteo.<br />- Cómo elegir un portabebés adecuado.<br />- Colocación correcta del portabebés.<br />- Trucos para asegurar un uso confortable del portabebés.</p>', 'taller-de-porteo', 'Taller de porteo en Zaragoza', '', 'Aprende a portear a tu bebé de manera segura. En nuestros talleres te ofrecemos la oportunidad de aprender a usar el mejor portabebes para ti y para tu bebé.'),
(279, 1, 4, 'Taller de porteo', '', 'taller-de-porteo', '', '', ''),
(280, 1, 3, 'Sacos gemelares', '<h2>Sacos gemelares el doble de bonitos!</h2>', 'sacos-gemelares', 'Sacos gemelares diferentes', '', 'Sacos gemelares para abrigar a tus peques y distingir tu carrito del resto. Confeccionados a medida para tu carrito gemelar.'),
(280, 1, 4, 'Sacos gemelares', '', 'sacos-gemelares', '', '', ''),
(281, 1, 1, 'BUGABOO ANT', '', 'fundas-bugaboo-ant', '', '', ''),
(281, 1, 3, 'BUGABOO ANT', '<h2>Los colores crean recuerdos y van directos al corazón. Esto ocurre con nuestras exclusivas <strong>fundas Bugaboo Ant</strong>.</h2>', 'fundas-bugaboo-ant', 'Fundas Bugaboo Ant', '', 'Bugaboo Ant: fundas a medida para diferencia tu carrito del resto. Somos especialistas en confeccionar sacos, fundas, bolsos y capotas para Bugaboo.'),
(289, 1, 1, 'BUGABOO BUTTERFLY', '', 'bugaboo-butterfly', '', '', ''),
(289, 1, 3, 'BUGABOO BUTTERFLY', '<h2>Fundas para Bugaboo Butterfly, para que tu sillita luzca diferente y única!</h2>', 'bugaboo-butterfly', 'Bugaboo Butterfly - fundas a medida para vestir tu silla', '', 'En Teoyleo tenemos las mejores fundas para vestir tu silla BUGABOO BUTTERFLY. Las confeccionamos a medida para que queden perfectas!'),
